let Viewer = function (config) {
    let me = this;
    me.id = config.id;
    me.container = config.container;
    me.project = config.project;
    me.X = 218;
    me.Y = 102;
    let Elements = [];
    me.Elements = Elements;
    me.Frames = [];
    me.addElement = function (el) {
        Elements.push(el);
    };
    me.createElement = function (el) {
        me.addElement(el);
    };
    /**
     * 添加容器
     * @param {any} id
     * @param {any} name
     * @param {any} frame
     */
    me.addFrame = function (id, name, frame) {
        let frame0 = me.getFrame(id);
        if (frame0) { return; }
        let obj = {
            id: id,
            name: name,
            frame: frame
        };
        me.Frames.push(obj);
    };
    /**
     * 获取容器
     * @param {any} id
     */
    me.getFrame = function (id) {
        let r;
        $.each(me.Frames, function (n, v) {
            if (id == v.id) {
                v.frameParentId = '';
                r = v;
                return false;
            }
        });
        return r;
    };
    /**
     * 获取元素
     * @param {any} id
     */
    me.getElement = function (id) {
        let el;
        $.each(Elements, function (n, v) {
            if (v.id == id) {
                el = v;
                return false;
            }
        });
        return el;
    }
}
