    //刷新阴影
    me.refreshBgShadow = function () {
        //2px 1px 5px gold,inset 2px 1px 2px 0px red
        let enabledOuter = (me.Attribute.Background.OuterShadowEnabled == true) ? '' : 'none';
        let enabledInner = (me.Attribute.Background.InnerShadowEnabled == true) ? 'inset' : 'none';
        let outerShadow = '';
        let innerShadow = '';
        if (preview_config_showhotpoint == true) {
            let keys = Object.keys(me.Attribute.Events);
            $.each(keys, function (n, v) {
                let ev = me.Attribute.Events[v];
                if (ev.actions.length > 0) {
                    outerShadow = '0 0 10px 3px #15d6ba';
                    return false;
                }
            });
        }
        else {
            if (me.Attribute.Background.OuterShadowEnabled == true) {
                let c = WidgetColor.ColorObjectToCssCode(me.Attribute.Background.OuterShadowColor);
                outerShadow = ''
                    + me.Attribute.Background.OuterShadowX + 'px '
                    + me.Attribute.Background.OuterShadowY + 'px '
                    + me.Attribute.Background.OuterShadowBlur + 'px '
                    + me.Attribute.Background.OuterShadowExtend + 'px '
                    //+ me.Attribute.Background.OuterShadowColor;
                    + c;
            }
        }
        if (me.Attribute.Background.InnerShadowEnabled == true) {
            let c = WidgetColor.ColorObjectToCssCode(me.Attribute.Background.InnerShadowColor);
            if (outerShadow == '') { innerShadow = "inset " }
            else { innerShadow += ',inset ' }
            innerShadow += me.Attribute.Background.InnerShadowX + 'px '
                + me.Attribute.Background.InnerShadowY + 'px '
                + me.Attribute.Background.InnerShadowBlur + 'px '
                + me.Attribute.Background.InnerShadowExtend + 'px '
                //+ me.Attribute.Background.InnerShadowColor;
                + c;
        }
        let shadow = outerShadow + innerShadow;
        box.css('box-shadow', shadow);
    };
