let BaseFrameComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'base容器';
    selfconfig.iconClsLink = '/Content/componentLibrary/base/icon.css';
    selfconfig.iconCls = config.iconCls || 'atomicon-component-frame';
    selfconfig.elType = "BaseFrame";
    selfconfig.src = 'base/frame';
    selfconfig.AttributeBackgroundDisabled = true;
    selfconfig.IsFrame = true;
    Element.call(this, container, selfconfig);

    let frameViewBox = $('<div></div>');
    let frameMask = $('<div></div>');
    let isview = false;
    let initFrame = function () {
        me.addElement(frameViewBox);
        if (isview == false) {
            me.addElement(frameMask);
            frameMask.css('background-color', 'rgba(255,165,0,.1)');
            frameMask.css('position', 'absolute');
            frameMask.css('width', '100%');
            frameMask.css('height', '100%');
            frameMask.css('left', '0px');
            frameMask.css('top', '0px');
            frameMask.css('z-index', '999999');
        }
        me.loadChildren();
        me.editor.addFrame(me.id, me.Name, frameViewBox);
        frameViewBox.css('width', '100%');
        frameViewBox.css('height', '100%');
        frameViewBox.css('border', 'solid 0px #000000');
        me.refreshViewFrame();
    };
    me.refreshStyle = function () {
        //me.refreshBorder();
    };
    me.refreshViewFrame = function () {
        me.setOverflow(me.Attribute.BaseIframe.ScrollBar);
        let pageid = me.Attribute.BaseIframe.pageid;
        if (pageid && pageid != '') {
            let pageobj = me.project.getPage(pageid);
            if (pageobj) {
                me.pageJump(pageid, frameViewBox);
            } else {
                me.project.readPage(pageid, frameViewBox);
            }
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(200);
        me.setLayoutH(200);
        me.Attribute.BaseIframe = { pageid: '', ScrollBar: 'auto' };
        me.framePath = '';
        me.frameParentId = '';
        initFrame();
    };
    me.loadChildClass = function (cfg) {
        me.framePath = '';
        me.frameParentId = '';
        initFrame();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initFrame();
    };
    me.refreshChildView = function () {
        isview = true;
        me.framePath = '';
        me.frameParentId = '';
        me.refreshStyle();
        me.refreshViewFrame();
    };
};
