let BaseButtonComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = '按钮';
    //selfconfig.iconClsLink = '/Content/componentLibrary/base/icon.css';
    //selfconfig.iconCls = config.iconCls || 'atomicon-component-base-button';
    selfconfig.elType = 'BaseButton';
    selfconfig.src = 'base/button';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;
    Element.call(this, container, selfconfig);

    let buttonBox = $('<div>按钮</div>');
    let isview = false;
    let pressed = false;
    let initButton = function () {
        me.setOverflow('visible');
        buttonBox.css('textAlign', 'center');
        buttonBox.css('cursor', 'default');
        buttonBox.css('width', '100%');
        buttonBox.css('height', '100%');
        buttonBox.css('border-style', 'solid');
        buttonBox.css('lineHeight', me.Attribute.Layout.H + 'px');
        me.addElement(buttonBox);
        me.loadChildren();
        if (config.params) {
        }
    }
    me.setChildrenSize = function (pos) {
        buttonBox.css('lineHeight', pos.H + 'px');
    }
    me.refreshBtn = function () {
        buttonBox.text(me.Attribute.Button.Default.Text.Content);
        buttonBox.css('color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Default.Text.Color));
        buttonBox.css('font-size', me.Attribute.Button.Default.Text.FontSize + 'px');
        buttonBox.css('font-family', me.Attribute.Button.Default.Text.FontFamily);
        buttonBox.css('backgroundColor', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Default.BackgroundColor));
        buttonBox.css('border-width', me.Attribute.Button.Default.Border.Width + 'px');
        buttonBox.css('border-color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Default.Border.Color));
        buttonBox.css('border-radius', me.Attribute.Button.Default.Border.Corner + 'px');
        buttonBox.css('font-weight', (me.Attribute.Button.Default.Text.Bold == true) ? 'bold' : 'normal')

        if (me.Attribute.Button.Style3D == true) {
            buttonBox.css('box-shadow', '2px 2px 2px 0 rgba(0,0,0,0.3)');
        }
        else {
            buttonBox.css('box-shadow', 'none');
        }

        if (isview == true) {
            buttonBox.css('cursor', 'pointer');
            //hover
            if (me.Attribute.Button.PressKeep == false || (me.Attribute.Button.PressKeep == true && pressed == false)) {
                buttonBox.on('mouseover', function () { setHoverStyle(); });
                buttonBox.on('mouseout', function () { setNormalStyle(); });
            }
            else {
                buttonBox.unbind('mouseover');
                buttonBox.unbind('mouseout');
            }
            //pressed
            buttonBox.on('mousedown', function () {
                setPressedStyle();
                $(document).on('mouseup', function () {
                    buttonBox.unbind('mouseup');
                    $(document).unbind('mouseup');
                });

                buttonBox.on('mouseup', function () {
                    changePressStyle();
                    if (me.Attribute.Button.PressKeep == false || (me.Attribute.Button.PressKeep == true && pressed == false)) {
                        buttonBox.on('mouseover', function () { setHoverStyle(); });
                        buttonBox.on('mouseout', function () { setNormalStyle(); });
                    }
                    else {
                        buttonBox.unbind('mouseover');
                        buttonBox.unbind('mouseout');
                    }
                });
            });
        }
    };
    //设置为默认样式
    let setNormalStyle = function () {
        buttonBox.css('color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Default.Text.Color));
        buttonBox.css('backgroundColor', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Default.BackgroundColor));
        buttonBox.css('border-color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Default.Border.Color));
    };
    //设置为鼠标滑过样式
    let setHoverStyle = function () {
        buttonBox.css('color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Hover.Text.Color));
        buttonBox.css('backgroundColor', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Hover.BackgroundColor));
        buttonBox.css('border-color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Hover.Border.Color));
    };
    //设置按下样式
    let setPressedStyle = function () {
        buttonBox.css('color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Pressed.Text.Color));
        buttonBox.css('backgroundColor', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Pressed.BackgroundColor));
        buttonBox.css('border-color', WidgetColor.ColorObjectToCssCode(me.Attribute.Button.Pressed.Border.Color));
    };
    //按下切换
    let changePressStyle = function () {
        if (me.Attribute.Button.PressKeep == true) {
            if (pressed == true) {
                setHoverStyle();
            }
            pressed = !pressed;
        }
        else {
            setHoverStyle();
        }
    };
    me.initChildClass = function (cfg) {
        me.setLayoutW(75);
        me.setLayoutH(32);
        me.Attribute.Button = {
            Style3D: false,
            PressKeep: false,
            Default: {
                Text: {
                    Content: '按钮',
                    FontSize: 12,
                    FontFamily: '宋体',
                    Color: { ColorR: 51, ColorG: 153, ColorB: 204, A: 1 },
                    Bold: false
                },
                BackgroundColor: { ColorR: 255, ColorG: 255, ColorB: 255, A: 1 },
                Border: {
                    Width: 1,
                    Color: { ColorR: 51, ColorG: 153, ColorB: 204, A: 1 },
                    Corner: 5
                }
            },
            Hover: {
                Text: {
                    Color: { ColorR: 255, ColorG: 255, ColorB: 255, A: 1 }
                },
                BackgroundColor: { ColorR: 51, ColorG: 153, ColorB: 204, A: 1 },
                Border: {
                    Color: { ColorR: 51, ColorG: 153, ColorB: 204, A: 1 }
                }
            },
            Pressed: {
                Text: {
                    Color: { ColorR: 255, ColorG: 255, ColorB: 255, A: 1 }
                },
                BackgroundColor: { ColorR: 51, ColorG: 153, ColorB: 204, A: 1 },
                Border: {
                    Color: { ColorR: 51, ColorG: 153, ColorB: 204, A: 1 }
                }
            }
        };
        initButton();
        me.refreshBtn();
    };
    me.loadChildClass = function (cfg) {
        initButton();
        me.refreshBtn();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initButton();
        me.refreshBtn();
    };
    me.refreshChildView = function () {
        me.refreshBtn();
    };
};
