let BaseSwitchButtonComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = '开关';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;
    selfconfig.elType = 'BaseSwitchButton';
    selfconfig.src = 'base/switchbutton';
    Element.call(this, container, selfconfig);

    let selected = true;
    let btnBorderRadius = 32;
    let isview = false;

    let buttonBox = $('<div></div>');
    let circle = $('<div></div>');
    buttonBox.append(circle);
    let initButton = function () {
        circle.css('width', '26px');
        circle.css('height', '26px');
        me.addElement(buttonBox);
        me.loadChildren();
        if (config.params) {
        }
        me.refreshBtn();
    }
    me.setChildrenSize = function (pos) {
        me.refreshBtn();
    };
    me.refreshBtn = function () {
        let pos = me.getLocation();
        let h = pos.H - 4;
        let w = pos.H - 4;
        let left = 0;
        let shape = me.Attribute.SwitchButton.Shape;

        circle.css('borderRadius', btnBorderRadius + 'px');
        circle.css('margin', '2px');
        circle.css('backgroundColor', '#ffffff');
        circle.css('position', 'absolute');
        circle.css('left', '28px');
        circle.css('top', '0px');

        buttonBox.css('cursor', 'default');
        buttonBox.css('width', '100%');
        buttonBox.css('height', '100%');
        buttonBox.css('borderRadius', btnBorderRadius + 'px');
        buttonBox.css('border', 'solid 1px #dddddd');
        buttonBox.css('backgroundColor', WidgetColor.ColorObjectToCssCode(me.Attribute.SwitchButton.BackgroundColor));
        buttonBox.css('position', 'relative');

        if (pos.H < pos.W) {
            buttonBox.css('width', pos.W + 'px');
            buttonBox.css('height', pos.H + 'px');
            circle.css('width', (pos.H - 6) + 'px');
            circle.css('height', (pos.H - 6) + 'px');
            left = (pos.W - pos.H);
            circle.css('left', left + 'px');
            if (shape == 'circle') {
                buttonBox.css('border-radius', pos.W + 'px');
                circle.css('border-radius', pos.W + 'px');
            }
            else {
                let r = getBoxBorderWidth(shape);
                me.setSwitchButtonShape(r);
            }
        } else if (pos.H > pos.W) {
            buttonBox.css('width', pos.W + 'px');
            buttonBox.css('height', pos.W / 2 + 'px');
            circle.css('width', (pos.W / 2 - 6) + 'px');
            circle.css('height', (pos.W / 2 - 6) + 'px');
            left = (pos.W / 2);
            circle.css('left', left + 'px');
            if (shape == 'circle') {
                buttonBox.css('border-radius', pos.W / 2 + 'px');
                circle.css('border-radius', pos.W / 2 + 'px');
            }
            else {
                let r = getBoxBorderWidth(shape);
                me.setSwitchButtonShape(r);
            }
        } else {
            buttonBox.css('width', pos.W + 'px');
            buttonBox.css('height', pos.H + 'px');
            circle.css('width', (pos.W / 2 - 6) + 'px');
            circle.css('height', (pos.W / 2 - 6) + 'px');
            left = 0;
        }
        if (isview == true) {
            buttonBox.unbind('click');
            buttonBox.on('click', function () {
                if (selected == true) {
                    circle.animate({ left: '2px' }, 200, function () {
                        buttonBox.css('backgroundColor', '#dddddd');
                    });
                }
                else {
                    circle.animate({ left: left + 'px' }, 200, function () {
                        buttonBox.css('backgroundColor', WidgetColor.ColorObjectToCssCode(me.Attribute.SwitchButton.BackgroundColor));
                    });
                }
                selected = !selected;
            });
        }
    }

    let initView = function () {
        isview = true;
        me.refreshBtn();
    }

    me.setSwitchButtonBackgroundColor = function (v) {
        buttonBox.css('background-color', v);
    }
    me.setSwitchButtonColor = function (v) {
        circle.css('background-color', v);
    };
    me.setSwitchButtonShape = function (v) {
        circle.css('border-radius', v + 'px');
        buttonBox.css('border-radius', v + 'px');
    };
    let getBoxBorderWidth = function (s) {
        let w = 0;
        if (s == 'rect') {
            w = 0;
        } else if (s == 'circlerect') {
            w = 5;
        }
        return w;
    };
    me.initChildClass = function (cfg) {
        me.setLayoutW(64);
        me.setLayoutH(34);
        me.Attribute.SwitchButton = {
            BackgroundColor: { ColorR: 51, ColorG: 153, ColorB: 204, A: 1 },
            Shape: 'circle'
        };
        initButton();
    };
    me.loadChildClass = function (cfg) {
        initButton();
    };
    me.viewChildClass = function (cfg) {
        initButton();
        initView();
    };
    me.refreshChildView = function () {
        me.refreshBtn();
    };
};
BaseSwitchButtonComponent.prototype = Object.create(Element.prototype);
BaseSwitchButtonComponent.prototype.constructor = BaseSwitchButtonComponent;

