    me.refreshMenuChildrenStyle = function (li, a, items) {
        let arrow = $('<span class="arrow"></span>');
        a.append(arrow);
        arrow.text('<');
        let ul_child = $('<ul></ul>');
        li.append(ul_child);
        ul_child.addClass('treeview-menu');
        $.each(items, function (m, o) {
            let li_child = $('<li></li>');
            let a_child = $('<a href="javascript:;"></a>');
            let icon_child = $('<i></i>');
            let txt_child = $('<span></span>');
            ul_child.append(li_child);
            li_child.append(a_child);
            a_child.append(icon_child);
            a_child.append(txt_child);
            let icon_svg = $(o.icon);
            icon_svg.css('width', '100%');
            icon_svg.css('heigh', '100%');
            icon_child.append(icon_svg);
            icon_child.css('display', 'inline-block');
            icon_child.css('width', '16px');
            icon_child.css('height', '20px');
            icon_child.css('margin-right', '5px');
            icon_child.css('vertical-align', 'bottom');


            txt_child.text(o.text);
            if (o.children && o.children.length > 0) {
                me.refreshMenuChildrenStyle(li_child, a_child, o.children);
            } else {
                a_child.on('click', function () {
                    //open link
                    me.framePath = '';
                    me.frameParentId = '';
                    let action = {
                        pageid: o.pageid,
                        target: o.target
                    };
                    me.pageLinkAction(action);
                });
            }

        });
        a.on('click', function () {
            let checkElement = a.next();
            var parent_li = a.parent("li");
            if (checkElement.is('.menu-open')) {
                checkElement.slideUp(animationSpeed, function () {
                    checkElement.removeClass('menu-open');
                });
                parent_li.removeClass("active");
            } else {
                checkElement.slideDown(animationSpeed, function () {
                    checkElement.addClass('menu-open');
                    li.find('li.active').removeClass('active');
                    parent_li.addClass('active');
                });
            }
        });
    }

