let SchemeViewUiTabsComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi标签页';
    selfconfig.elType = "SchemeViewUiTabs";
    selfconfig.src = 'scheme_viewui/tabs';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let tabs_box = $('<div class="componentstyle-schemeviewui-tabs"></div>');
    me.ICON_COLOR = { ColorR: 45, ColorG: 140, ColorB: 240, A: 1 };

    let initTabs = function () {
        me.setOverflow('visible');
        me.addElement(tabs_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        tabs_box.html('');
        let nav = $('<nav></nav>');
        tabs_box.append(nav);

        let body = $('<div></div>');
        tabs_box.append(body);
        if (me.Attribute.SchemeViewUiTabs.Border == true) {
            body.css('border-left-color', 'rgba(221,221,221,1)');
            body.css('border-right-color', 'rgba(221,221,221,1)');
            body.css('border-bottom-color', 'rgba(221,221,221,1)');
        } else {
            body.css('border-left-color', 'rgba(221,221,221,0)');
            body.css('border-right-color', 'rgba(221,221,221,0)');
            body.css('border-bottom-color', 'rgba(221,221,221,0)');
        }
        body.css('height', (pos.H - 37) + 'px');

        let items = me.Attribute.SchemeViewUiTabs.Items;

        $.each(items, function (n, v) {
            let label = $('<label></label>');
            nav.append(label);
            let input = $('<input type="radio" />');
            label.append(input);
            input.attr('name', 'schemeviewuitabs_' + me.id);
            if (n == 0) {
                input.attr('checked', 'checked');
            }

            let txt = $('<span></span>');
            label.append(txt);
            if (v.Icon && v.Icon != '') {
                let icon = $('<i></i>');
                txt.append(icon);
                let img = $(v.Icon);
                icon.append(img);
            }
            txt.append(v.Text);

            if (v.Disabled == true) {
                input.attr('disabled', 'disabled');
            } else {
                input.removeAttr('disabled');
                input.on('click', function () {
                    me.refreshFrame(v.pageid, body);
                });
            }
            if (v.Checked) {
                me.refreshFrame(v.pageid, body);
            }
        });
    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Disabled: v.attributes.Disabled,
                Icon: v.attributes.Icon,
                Checked: v.attributes.Checked,
                pageid: v.attributes.pageid
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Disabled: v.Disabled,
                    Icon: v.Icon,
                    Checked: v.Checked,
                    pageid: v.pageid
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    /**
     * 刷新容器内容
     * @param {any} pageid
     */
    me.refreshFrame = function (pageid, frame) {
        me.framePath = '';
        me.frameParentId = '';
        frame.html('');
        if (pageid && pageid != '') {
            let pageobj = me.project.getPage(pageid);
            if (pageobj) {
                me.pageJump(pageid, frame);
            } else {
                me.project.readPage(pageid, frame);
            }
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(360);
        me.setLayoutH(200);
        me.Attribute.SchemeViewUiTabs = {
            Border: true,
            Items: [{
                Text: '标签一',
                Disabled: false,
                Checked: true
            }, {
                Text: '标签二',
                Disabled: false,
                Checked: false
            }, {
                Text: '标签三',
                Disabled: false,
                Checked: false
            }]
        };
        initTabs();
    };
    me.loadChildClass = function (cfg) {
        initTabs();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initTabs();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
