let SchemeViewUiTextBoxComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi输入框';
    selfconfig.elType = "SchemeViewUiTextBox";
    selfconfig.src = 'scheme_viewui/textbox';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let input_box = $("<div></div>");
    me.Size = {
        large: { Height: 40 },
        normal: { Height: 32 },
        small: { Height: 24 },
    };
    me.IconColor = { ColorR: 81, ColorG: 90, ColorB: 110, A: 1 }

    let initTextBox = function () {
        me.setOverflow('visible');
        me.addElement(input_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let input_w = pos.W;
        let h = me.Size[me.Attribute.SchemeViewUiTextBox.Size].Height;
        let top = (pos.H - h) / 2;

        input_box.html('');
        input_box.attr('class', '');
        input_box.addClass('componentstyle-schemeviewui-textbox-' + me.Attribute.SchemeViewUiTextBox.Size);
        input_box.css('top', top + 'px');
        input_box.css('width', pos.W + 'px');

        let icon_prefix = $('<span></span>');
        input_box.append(icon_prefix);

        let input = $('<input />');
        input_box.append(input);
        if (me.Attribute.SchemeViewUiTextBox.Password == true) {
            input.attr('type', 'password');
        } else {
            input.attr('type', 'text');
        }
        input.attr('placeholder', me.Attribute.SchemeViewUiTextBox.PlaceHolder);
        input.attr('maxlength', me.Attribute.SchemeViewUiTextBox.CountLimit);
        input.val(me.Attribute.SchemeViewUiTextBox.Text);

        let counter = $('<counter>1/10</counter>');
        input_box.append(counter);

        let btn_clear = $('<a><i>×</i></a>');
        input_box.append(btn_clear);
        //btn_clear.addClass('fa icon-remove-sign');


        if (me.Attribute.SchemeViewUiTextBox.Icon) {
            let img = $(me.Attribute.SchemeViewUiTextBox.Icon);
            icon_prefix.append(img);
            WidgetIcon.refreshIconStyle(img, 0, me.IconColor, me.IconColor, null);
            input_w = pos.W - me.Size[me.Attribute.SchemeViewUiTextBox.Size].Height;
            input.css('border-top-left-radius', 0);
            input.css('border-bottom-left-radius', 0);
        } else {
            icon_prefix.css('display', 'none');
            input.css('left', '0');
        }
        if (me.Attribute.SchemeViewUiTextBox.CountEnabled == true) {
            input.css('padding-right', '50px');
            let c = input.val().length;
            counter.text(c + '/' + me.Attribute.SchemeViewUiTextBox.CountLimit);
        } else {
            input.css('padding-right', '7px');
            counter.css('display', 'none');
        }

        input.css('width', input_w + 'px');




        if (me.Attribute.SchemeViewUiTextBox.Disabled == true) {
            input.attr('disabled', 'disabled');
        } else {
            input.removeAttr('disabled');
            input.on('keyup', function () {
                let txt = $(this).val();
                counter.text(txt.length + '/' + me.Attribute.SchemeViewUiTextBox.CountLimit);
                if (me.Attribute.SchemeViewUiTextBox.ClearButton == true && input.val() != '') {
                    btn_clear.css('display', 'block');
                }
                if (txt.length > me.Attribute.SchemeViewUiTextBox.CountLimit) {
                    return false;
                }
            });
        }
        btn_clear.on('click', function () {
            input.val('');
            btn_clear.css('display', 'none');
        });
        if (me.Attribute.SchemeViewUiTextBox.ClearButton == true) {
            input_box.hover(function () {
                let disabled = input.attr('disabled');
                if (disabled) { return; }
                if (input.val() != '') {
                    btn_clear.css('display', 'block');
                }
            }, function () {
                btn_clear.css('display', 'none');
            });
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(40);
        me.Attribute.SchemeViewUiTextBox = {
            Text: '',
            PlaceHolder: '请输入内容',
            Size: 'normal',
            Disabled: false,
            Icon: undefined,
            Password: false,
            CountEnabled: true,
            CountLimit: 10,
            ClearButton: true
        };
        initTextBox();
    };
    me.loadChildClass = function (cfg) {
        initTextBox();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initTextBox();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
