        let percent = me.Attribute.SchemeViewUiProgressRing.Length / 100.00;
        svg.innerHTML = '';
        svg.setAttribute('width', pos.W + 'px');
        svg.setAttribute('height', pos.H + 'px');
        svg.setAttribute('viewBox', '0 0 100 100');

        svg.appendChild(circle_bg);
