let SchemeViewUiBreadCrumbComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi面包屑';
    selfconfig.elType = "SchemeViewUiBreadCrumb";
    selfconfig.src = 'scheme_viewui/breadcrumb';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let breadcrumb_box = $('<ul class="componentstyle-schemeviewui-breadcrumb"></ul>');

    let initBreadCrumb = function () {
        me.addElement(breadcrumb_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        breadcrumb_box.html('');
        let items = me.Attribute.SchemeViewUiBreadCrumb.Items;
        let top = pos.H / 2 - 16;
        if (top < 0) { top = 0; }
        breadcrumb_box.css('top', top + 'px');

        $.each(items, function (n, v) {
            let li = $("<li></li>");
            breadcrumb_box.append(li);
            if (v.Icon) {
                let icon_box = $('<i></i>');
                li.append(icon_box);

                let img = $(v.Icon);
                icon_box.append(img);
            }

            let span = $('<span></span>');
            li.append(span);
            span.text(v.Text);

            li.unbind('click');
            li.on('click', function () {
                me.framePath = '';
                me.frameParentId = '';
                let action = {
                    pageid: v.pageid,
                    target: v.target
                };
                me.pageLinkAction(action);
            });
        });
    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Disabled: v.attributes.Disabled,
                Icon: v.attributes.Icon,
                target: v.attributes.target,
                pageid: v.attributes.pageid
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Disabled: v.Disabled,
                    Icon: v.Icon,
                    target: v.target,
                    pageid: v.pageid
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    /**
     * 加载元素链接的容器框架设置项
     * @param {any} editor
     * @param {any} frameid
     * @param {any} combo jquery-dom  $('#domid')
     */
    me.loadElementLinkTargetFrames = function (editor, frameid, combo) {
        let data = [];
        let frame_exist = false;
        $.each(editor.Frames, function (n, v) {
            let text = (v.name == '') ? '未命名' : v.name;
            if (frame_exist == false) {
                if (v.id == frameid) {
                    frame_exist = true;
                }
            }
            data.push({
                id: v.id,
                text: text
            });
        });
        combo.combobox('loadData', data);
        if (frame_exist == true) {
            combo.combobox('setValue', frameid);
        } else {
            combo.combobox('clear');
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(32);
        me.Attribute.SchemeViewUiBreadCrumb = {
            Items: [{
                Text: '首页',
                Disabled: false
            }, {
                Text: '二级页',
                Disabled: false
            }, {
                Text: '三级页',
                Disabled: false
            }]
        };
        initBreadCrumb();
    };
    me.loadChildClass = function (cfg) {
        initBreadCrumb();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initBreadCrumb();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
