let SchemeViewUiStepBarComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi步骤条';
    selfconfig.elType = "SchemeViewUiStepBar";
    selfconfig.src = 'scheme_viewui/stepbar';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let stepbar_box = $('<ul class="componentstyle-schemeviewui-stepbar"></ul>');

    let initStepBar = function () {
        me.addElement(stepbar_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        stepbar_box.html('');
        let items = me.Attribute.SchemeViewUiStepBar.Items;
        let li_w = pos.W / items.length;
        let stepIndex = me.Attribute.SchemeViewUiStepBar.CurrentStep - 1;
        $.each(items, function (n, v) {
            let li = $("<li></li>");
            stepbar_box.append(li);
            li.css('width', li_w + 'px');

            let i = $('<i></i>');
            li.append(i);

            let span = $('<span></span>');
            li.append(span);
            span.text(v.Text);

            let p = $('<p></p>');
            li.append(p);
            p.text(v.Desc);

            if (v.Icon) {
                i.css('border', 'rgba(255,255,255,0)');
                let img = $(v.Icon);
                i.append(img);
                if (n < stepIndex) {
                    li.addClass('completed');
                }
                else if (me.Attribute.SchemeViewUiStepBar.Error == true && n == stepIndex) {
                    i.find('svg').css('fill', '#ed4014');
                    i.find('svg').css('stroke', '#ed4014');
                    span.css('color', '#ed4014');
                    p.css('color', '#ed4014');
                }
            }
            else {
                if (n > stepIndex) {
                    i.text(n + 1);
                } else if (n == stepIndex) {
                    if (me.Attribute.SchemeViewUiStepBar.Error == true) {
                        i.text('×');
                        i.css('color', '#ed4014');
                        i.css('background-color', '#fff');
                        i.css('border', 'solid 1px #ed4014');
                        span.css('color', '#ed4014');
                        p.css('color', '#ed4014');
                    }
                    else {
                        i.text(n + 1);
                        i.css('color', '#fff');
                        i.css('background-color', '#2d8cf0');
                        i.css('border', 'solid 1px #2d8cf0');
                    }
                } else {
                    i.text('√');
                    i.css('color', '#2d8cf0');
                    i.css('border', 'solid 1px #2d8cf0');
                    li.addClass('completed');
                }
            }



        });
    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Desc: v.attributes.Desc,
                Icon: v.attributes.Icon,
                target: v.attributes.target,
                pageid: v.attributes.pageid
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Desc: v.Desc,
                    Icon: v.Icon,
                    target: v.target,
                    pageid: v.pageid
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(880);
        me.setLayoutH(100);
        me.Attribute.SchemeViewUiStepBar = {
            CurrentStep: 2,
            Error: false,
            Items: [{
                Text: '已完成',
                Desc: '这里是该步骤的描述信息'
            }, {
                Text: '进行中',
                Desc: '这里是该步骤的描述信息'
            }, {
                Text: '待进行',
                Desc: '这里是该步骤的描述信息'
            }, {
                Text: '待进行',
                Desc: '这里是该步骤的描述信息'
            }]
        };
        initStepBar();
    };
    me.loadChildClass = function (cfg) {
        initStepBar();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initStepBar();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
