let SchemeViewUiTreeComponent = function (container, config) {
    let me = this
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi树';
    selfconfig.elType = "SchemeViewUiTree";
    selfconfig.src = 'scheme_viewui/tree';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;
    Element.call(this, container, selfconfig);

    let isview = false;
    let tree_box = $('<div class="componentstyle-schemeviewui-tree"></div>');

    let initTree = function () {
        me.addElement(tree_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '1');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function () {
        me.refreshStyle();
    };

    me.refreshStyle = function () {
        tree_box.html('');
        let ul = $('<ul></ul>');
        tree_box.append(ul);
        let items = me.Attribute.SchemeViewUiTree.Items;
        $.each(items, function (n, v) {
            let li = $('<li></li>');
            ul.append(li);
            let action = {
                pageid: v.pageid,
                target: v.target
            };
            me.buildChildren(li, v.children, v.text, v.icon, action, v.checked);
        });
    };

    me.buildChildren = function (li, items, text, icon, action, checked) {
        li.attr('opened', true);
        li.attr('status', 'no');

        let arrow = $('<i></i>');
        li.append(arrow);
        if (items && items.length > 0) { arrow.attr('class', 'fa fa-angle-down'); }

        if (me.Attribute.SchemeViewUiTree.ShowCheckBox == true) {
            let label = $('<label></label>');
            li.append(label);
            if (checked == true) {
                label.attr('class', 'fa fa-check-square');
                label.css('color', '#2d8cf0');
                li.attr('status', 'yes');
            } else {
                label.attr('class', 'fa fa-square-o');
                label.css('color', '#dcdee2');
                li.attr('status', 'no');
            }

            //复选框动作
            label.on('click', function () {
                let chidren_label = li.find('label');
                let chidren_li = li.find('li');
                let status = li.attr('status');

                if (status != 'no') {
                    chidren_label.attr('class', 'fa fa-square-o');
                    chidren_label.css('color', '#dcdee2');
                    li.attr('status', 'no');
                    chidren_li.attr('status', 'no');
                } else {
                    chidren_label.attr('class', 'fa fa-check-square');
                    chidren_label.css('color', '#2d8cf0');
                    li.attr('status', 'yes');
                    chidren_li.attr('status', 'yes');
                }
            });
        }

        let span = $('<span></span>');
        li.append(span);
        if (icon) {
            let icon_box = $('<i></i>');
            span.append(icon_box);
            let img = $(icon);
            icon_box.append(img);
        }
        span.append(text);
        span.on('click', function () {
            me.pageLinkAction(action);
        });

        if (items && items.length > 0) {
            let ul_child = $('<ul></ul>');
            li.append(ul_child);

            $.each(items, function (n, v) {
                let li_child = $('<li></li>');
                ul_child.append(li_child);
                let action_child = {
                    pageid: v.pageid,
                    target: v.target
                };

                me.buildChildren(li_child, v.children, v.text, v.icon, action_child, v.checked);
            });

            arrow.on('click', function () {
                let opened = li.attr('opened');
                if (opened) {
                    ul_child.css('overflow', 'hidden');
                    ul_child.animate({ height: 0 }, 200);
                    li.removeAttr('opened');
                } else {
                    ul_child.css('height', 'auto');
                    ul_child.css('overflow', 'visible');
                    li.attr('opened', true);
                }
            });
        }
    }

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                text: v.text,
                target: v.attributes.target,
                pageid: v.attributes.pageid,
                icon: v.attributes.icon,
                checked: v.attributes.checked
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.text,
                attributes: {
                    target: v.target,
                    pageid: v.pageid,
                    icon: v.icon,
                    checked: v.checked
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    /**
     * 加载元素链接的容器框架设置项
     * @param {any} editor
     * @param {any} frameid
     * @param {any} combo jquery-dom  $('#domid')
     */
    me.loadElementLinkTargetFrames = function (editor, frameid, combo) {
        let data = [];
        let frame_exist = false;
        $.each(editor.Frames, function (n, v) {
            let text = (v.name == '') ? '未命名' : v.name;
            if (frame_exist == false) {
                if (v.id == frameid) {
                    frame_exist = true;
                }
            }
            data.push({
                id: v.id,
                text: text
            });
        });
        combo.combobox('loadData', data);
        if (frame_exist == true) {
            combo.combobox('setValue', frameid);
        } else {
            combo.combobox('clear');
        }
    };

    me.initChildClass = function () {
        me.setLayoutW(260);
        me.setLayoutH(360);
        me.Attribute.SchemeViewUiTree = {
            ShowCheckBox: true,
            Items: [{
                text: '父节点 一',
                checked: true,
                children: [{
                    text: '节点 一',
                    checked: true
                }, {
                    text: '节点 二'
                }]
            }, {
                text: '父节点 二',
                children: [{
                    text: '节点 三'
                }, {
                    text: '节点 四'
                }]
            }, {
                text: '父节点 三',
                children: [{
                    text: '节点 五'
                }, {
                    text: '节点 六'
                }]
            }]
        };
        initTree();
    };
    me.loadChildClass = function () {
        initTree();
    };
    me.viewChildClass = function () {
        isview = true;
        initTree();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
