let SchemeViewUiIconSelectorComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi图标选择器';
    selfconfig.elType = "SchemeViewUiIconSelector";
    selfconfig.src = 'scheme_viewui/iconselector';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let input_box = $("<div></div>");
    let opened = false;
    me.Size = {
        large: { Height: 40 },
        normal: { Height: 32 },
        small: { Height: 24 },
    };
    me.IconColor = { ColorR: 81, ColorG: 90, ColorB: 110, A: 1 }

    let initTextBox = function () {
        me.setOverflow('visible');
        me.addElement(input_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let h = me.Size[me.Attribute.SchemeViewUiIconSelector.Size].Height;
        let input_w = pos.W - h;
        let top = (pos.H - h) / 2;
        let img_h = 370;

        input_box.html('');
        input_box.attr('class', '');
        input_box.addClass('componentstyle-schemeviewui-iconselector-' + me.Attribute.SchemeViewUiIconSelector.Size);
        input_box.css('top', top + 'px');
        input_box.css('width', pos.W + 'px');

        let icon_prefix = $('<i class="fa fa-adn"></i>');
        input_box.append(icon_prefix);

        let input = $('<input />');
        input_box.append(input);
        input.attr('placeholder', me.Attribute.SchemeViewUiIconSelector.PlaceHolder);
        input.attr('maxlength', me.Attribute.SchemeViewUiIconSelector.CountLimit);
        input.css('width', input_w + 'px');
        input.val(me.Attribute.SchemeViewUiIconSelector.Text);

        let icon_suffix = $('<span></span>');
        input_box.append(icon_suffix);
        let i_arrow = $('<i class="fa fa-angle-down"></i>');
        icon_suffix.append(i_arrow);

        let btn_clear = $('<a><i>×</i></a>');
        input_box.append(btn_clear);


        let img_box = $('<img />');
        input_box.append(img_box);
        let img = me.project.getImage(me.Attribute.ImageIds[0]);
        if (img) {
            img_box.attr('src', img.image);
        }


        if (me.Attribute.SchemeViewUiIconSelector.Disabled == true) {
            input.attr('disabled', 'disabled');
        } else {
            input.removeAttr('disabled');
            input.on('keyup', function () {
                let txt = $(this).val();
                if (me.Attribute.SchemeViewUiIconSelector.ClearButton == true && input.val() != '') {
                    btn_clear.css('display', 'block');
                }
                if (txt.length > me.Attribute.SchemeViewUiIconSelector.CountLimit) {
                    return false;
                }
            });
            input.on('mouseup', function () {
                if (opened == false) {
                    img_box.css('display', 'block');
                    img_box.css('height', '0');
                    img_box.animate({ height: img_h + 'px' }, 50);
                }
                opened = true;
            });
            img_box.on('click', function () {
                opened = false;
                input.val('logo-apple');
                icon_prefix.attr('class', 'fa fa-apple');
                img_box.animate({ height: 0 }, 50, function () {
                    img_box.css('height', img_h + 'px');
                    img_box.css('display', 'none');
                });
            });
            icon_suffix.on('click', function () {
                if (opened == false) {
                    img_box.css('display', 'block');
                    img_box.css('height', '0');
                    img_box.animate({ height: img_h + 'px' }, 50);
                }
                opened = true;
            });
        }
        btn_clear.on('click', function () {
            input.val('');
            icon_prefix.attr('class', '');
            btn_clear.css('display', 'none');
        });
        if (me.Attribute.SchemeViewUiIconSelector.ClearButton == true) {
            input_box.hover(function () {
                let disabled = input.attr('disabled');
                if (disabled) { return; }
                if (input.val() != '') {
                    btn_clear.css('display', 'block');
                }
            }, function () {
                btn_clear.css('display', 'none');
            });
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(40);
        me.Attribute.SchemeViewUiIconSelector = {
            Text: 'logo-chrome',
            PlaceHolder: '请选择',
            Size: 'normal',
            Disabled: false,
            Icon: undefined,
            CountEnabled: true,
            CountLimit: 500,
            ClearButton: true
        };
        me.Attribute.ImageIds = [];
        elset.getBase64Image('component/data/styles/scheme_viewui/images/iconselector.png', function (img) {
            let obj = __designer.project.addImage(img, 'base64');
            me.Attribute.ImageIds.push(obj.id);
        });
        initTextBox();
    };
    me.loadChildClass = function (cfg) {
        initTextBox();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initTextBox();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
