let SchemeViewUiNumberBoxComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi数字框';
    selfconfig.elType = "SchemeViewUiNumberBox";
    selfconfig.src = 'scheme_viewui/numberbox';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let input_box = $("<div></div>");
    let current_value = 0;
    me.Size = {
        large: { Height: 40 },
        normal: { Height: 32 },
        small: { Height: 24 },
    };
    me.IconColor = { ColorR: 81, ColorG: 90, ColorB: 110, A: 1 }

    let initTextBox = function () {
        me.setOverflow('visible');
        me.addElement(input_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '1');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let input_w = pos.W;
        let h = me.Size[me.Attribute.SchemeViewUiNumberBox.Size].Height;
        let top = (pos.H - h) / 2;
        current_value = me.Attribute.SchemeViewUiNumberBox.Value;

        input_box.html('');
        input_box.attr('class', '');
        input_box.addClass('componentstyle-schemeviewui-numberbox-' + me.Attribute.SchemeViewUiNumberBox.Size);
        input_box.css('top', top + 'px');
        input_box.css('width', pos.W + 'px');

        let input = $('<input />');
        input_box.append(input);
        input.val(current_value);

        let span = $('<span></span>');
        input_box.append(span);
        if (isview == false) {
            span.css('opacity', 1);
        }

        let i_up = $('<i class="fa fa-angle-up"></i>');
        span.append(i_up);

        let i_down = $('<i class="fa fa-angle-down"></i>');
        span.append(i_down);

        if (me.Attribute.SchemeViewUiNumberBox.Disabled == true) {
            input.attr('disabled', true);
        } else {
            input.removeAttr('disabled');
        }

        input.on('change', function (e) {
            let reg = /^\d{n,}$/;
            let txt = input.val();
            if (reg.test(txt)) {
                current_value = txt;
            } else {
                input.val(current_value);
            }
        });
        i_up.on('click', function () {
            current_value += 1;
            input.val(current_value);
        });
        i_down.on('click', function () {
            current_value -= 1;
            input.val(current_value);
        });

    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(78);
        me.setLayoutH(40);
        me.Attribute.SchemeViewUiNumberBox = {
            Value: 0,
            Size: 'normal',
            Disabled: false
        };
        initTextBox();
    };
    me.loadChildClass = function (cfg) {
        initTextBox();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initTextBox();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
