        let box = me.getBox();

        toast.html('');
        toast.append(icon);
        toast.append(txt);
        toast.css('display', 'block');
        toast.css('position', 'absolute');
        toast.css('width', pos.W + 'px');
        toast.css('height', pos.H + 'px');

        if (isview == true) {
            box.css('top', '0px');
            box.css('left', '0px');
            box.css('width', '100%');
            box.css('height', '100%');

            let w = box.outerWidth();
            let h = box.outerHeight();
            let scroll_x = $('#viewer').parent().scrollLeft();
            let scroll_y = $('#viewer').parent().scrollTop();

            if (box.parent().attr('id') == "viewer") {
                w = box.parent().parent().outerWidth();
                h = box.parent().parent().outerHeight();
            }
            toast.css('left', ((w - pos.W) / 2 + scroll_x) + 'px');
            switch (me.Attribute.SchemeViewUiShadeLoad.Position) {
                case 'top':
                    toast.css('top', (scroll_y + 10) + 'px');
                    break;
                case 'bottom':
                    toast.css('top', scroll_y + h - 138 + 'px');
                    break;
                default:
                    toast.css('top', (scroll_y + h - pos.H) / 2 + 'px');
                    break;
            }

        } else {
            toast.css('top', '0px');
            toast.css('left', '0px');
        }
        toast.css('border-radius', '5px');

        me.image.css('fill', '#2d8cf0');
        me.image.css('stroke', '#2d8cf0');
        icon.html('');
        icon.append(me.image);
        icon.css('width', me.Attribute.SchemeViewUiShadeLoad.IconSize + 'px');
