let SchemeViewUiCalendarComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ViewUi日历';
    selfconfig.elType = "SchemeViewUiCalendar";
    selfconfig.src = 'scheme_viewui/calendar';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let calendar_box = $('<div class="componentstyle-schemeviewui-calendar"></div>');

    let year = 2021;
    let month = 11;
    let type = 'month';//month date
    let header_h = 60;
    /**标注信息 */
    let desc = {};

    let initCalendar = function () {
        me.setOverflow('visible');
        me.addElement(calendar_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        year = new Date(me.Attribute.SchemeViewUiCalendar.Date).getFullYear();
        month = new Date(me.Attribute.SchemeViewUiCalendar.Date).getMonth() + 1;
        type = me.Attribute.SchemeViewUiCalendar.Type;
        loadDesc();
        calendar_box.html('');
        if (me.Attribute.SchemeViewUiCalendar.Focus == true) {
            calendar_box.attr('fc', true);
        }
        else {
            calendar_box.removeAttr('fc');
        }

        let table_h = (pos.H - 80);

        let header = $('<header></header>');
        calendar_box.append(header);
        let h4 = $('<h4></h4>');
        header.append(h4);
        h4.append(year + '年' + month + '月');

        let ctrl_btns = $('<div></div>');
        header.append(ctrl_btns);
        let btn_pre = $('<a href="javascript:;" class="fa fa-angle-left"></a>');
        ctrl_btns.append(btn_pre);
        btn_pre.on('click', function () {
            prePage();
        });

        let btn_today = $('<a href="javascript:;">今天</a>');
        ctrl_btns.append(btn_today);
        btn_today.on('click', function () {
            todayPage();
        });

        let btn_next = $('<a href="javascript:;" class="fa fa-angle-right"></a>');
        ctrl_btns.append(btn_next);
        btn_next.on('click', function () {
            nextPage();
        });
        if (me.Attribute.SchemeViewUiCalendar.YearMonthTab == true) {
            let btn_month = $('<a href="javascript:;">月</a>');
            ctrl_btns.append(btn_month);
            btn_month.on('click', function () {
                setType('month');
            });

            let btn_year = $('<a href="javascript:;">年</a>');
            ctrl_btns.append(btn_year);
            btn_year.on('click', function () {
                setType('year');
            });
        }
        buildMonthTable(table_h);
        buildDateTable(table_h);
        setType();
    };
    /**
     * 设置显示模式
     * @param {any} t
     */
    let setType = function (t) {
        if (t) {
            type = t;
        }
        if (type == 'month') {
            calendar_box.find('.componentstyle-schemeviewui-calendar-table-date').css('display', 'table');
            calendar_box.find('.componentstyle-schemeviewui-calendar-table-month').css('display', 'none');
        } else {
            calendar_box.find('.componentstyle-schemeviewui-calendar-table-date').css('display', 'none');
            calendar_box.find('.componentstyle-schemeviewui-calendar-table-month').css('display', 'table');
        }
        freshTitle();
    }
    /**
     * 创建月份表
     * @param {any} h
     */
    let buildMonthTable = function (h) {
        let table_month = $('<table class="componentstyle-schemeviewui-calendar-table-month"></table>');
        calendar_box.append(table_month);
        table_month.css('height', h + 'px');

        let table_tbody = $('<tbody></tbody>');
        table_month.append(table_tbody);

        for (let i = 0; i < 4; i++) {
            let row = $('<tr></tr>');
            table_tbody.append(row);
            for (let j = 0; j < 3; j++) {
                let td = $('<td></td>');
                row.append(td);
            }
        }
        refreshMonthTable();
    };
    /**
     * 创建日期表
     * @param {any} h
     */
    let buildDateTable = function (h) {
        let table_date = $('<table class="componentstyle-schemeviewui-calendar-table-date"></table>');
        calendar_box.append(table_date);
        table_date.css('height', h + 'px');
        let table_date_thead = $('<thead></thead>');
        table_date.append(table_date_thead);
        let table_date_thead_tr = $('<tr></tr>');
        table_date_thead.append(table_date_thead_tr);

        table_date_thead_tr.append($('<th>一</th>'));
        table_date_thead_tr.append($('<th>二</th>'));
        table_date_thead_tr.append($('<th>三</th>'));
        table_date_thead_tr.append($('<th>四</th>'));
        table_date_thead_tr.append($('<th>五</th>'));
        table_date_thead_tr.append($('<th>六</th>'));
        table_date_thead_tr.append($('<th>日</th>'));

        let table_date_tbody = $('<tbody></tbody>');
        table_date.append(table_date_tbody);

        for (let r = 0; r < 6; r++) {
            let row = $('<tr></tr>');
            table_date_tbody.append(row);
            for (let c = 0; c < 7; c++) {
                let td = $('<td></td>');
                row.append(td);
            }
        }
        refreshDateTable();
    };
    /**加载说明数据 */
    let loadDesc = function () {
        desc = {};
        $.each(me.Attribute.SchemeViewUiCalendar.Items, function (n, v) {
            let d = new Date(v.Date);
            let date = v.Date;
            let month = d.getFullYear() + '-' + (d.getMonth() + 1);
            if (!desc[date]) {
                desc[date] = {
                    list: []
                };
            }
            if (!desc[month]) {
                desc[month] = {
                    list: []
                };
            }
            desc[date].list.push({ text: v.Text, style: v.Style, target: v.target, pageid: v.pageid });
            desc[month].list.push({ text: v.Text, style: v.Style, target: v.target, pageid: v.pageid });
        });
    };
    let refreshMonthTable = function () {
        let rows = calendar_box.find('.componentstyle-schemeviewui-calendar-table-month tbody tr');
        $.each(rows, function (r, v) {
            let cols = $(v).find('td');
            $.each(cols, function (c, u) {
                let td = $(u);
                td.html('');
                let cell = $('<div></div>');
                td.append(cell);
                let m = (r * 3) + (c + 1);
                let span_m = $('<span></span>');
                cell.append(span_m);
                span_m.text(m + '月');

                let day = year + '-' + m;
                if (desc[day]) {
                    $.each(desc[day].list, function (n, d) {
                        buildLink(cell, d);
                    });
                }

            });
        });
    };
    /**
     * 刷新日期表格数据
     * @param {any} table
     */
    let refreshDateTable = function () {
        let firstDate = new Date(year + '-' + month + '-' + '1 00:00:00');
        let firstDayWeekIndex = firstDate.getDay();
        firstDate.setDate(firstDate.getDate() - firstDayWeekIndex);

        let rows = calendar_box.find('.componentstyle-schemeviewui-calendar-table-date tbody tr');
        $.each(rows, function (r, v) {
            let cols = $(v).find('td');
            $.each(cols, function (c, u) {
                let date = firstDate.getDate();
                let td = $(u);
                td.html('');
                let cell = $('<div></div>');
                td.append(cell);
                let day;//= year + '-' + month + '-' + date;

                if ((r == 0 && date > 20)) {
                    //上个月
                    cell.css('color', '#c5c8ce');
                    if (month == 1) {
                        day = (year - 1) + '-' + 12 + '-' + date;
                    } else {
                        day = year + '-' + (month - 1) + '-' + date;
                    }
                } else if ((r == 5 || r == 4) && date < 20) {
                    //下个月
                    cell.css('color', '#c5c8ce');
                    if (month == 12) {
                        day = (year + 1) + '-' + 1 + '-' + date;
                    } else {
                        day = year + '-' + (month + 1) + '-' + date;
                    }

                } else {
                    //本月
                    cell.css('color', '#515a6e');
                    day = year + '-' + month + '-' + date;
                }
                cell.attr('date', day);

                let day_txt = $('<span><span>');
                cell.append(day_txt);

                day_txt.text(date);

                if (desc[day]) {
                    $.each(desc[day].list, function (n, d) {
                        buildLink(cell, d);
                        //let span_desc = $('<span></span>');
                        //cell.append(span_desc);

                        //let i = $('<i></i>');
                        //span_desc.append(i);
                        //i.attr('class', d.style);

                        //span_desc.append(d.text);

                        //span_desc.on('click', function () {
                        //    me.framePath = '';
                        //    me.frameParentId = '';
                        //    let action = {
                        //        pageid: d.pageid,
                        //        target: d.target
                        //    };
                        //    me.pageLinkAction(action);
                        //});
                    });
                }

                firstDate.setDate(firstDate.getDate() + 1);
            });
        });
    };
    let buildLink = function (cell, data) {
        let span_desc = $('<span></span>');
        cell.append(span_desc);

        let i = $('<i></i>');
        span_desc.append(i);
        i.attr('class', data.style);

        span_desc.append(data.text);

        span_desc.on('click', function () {
            me.framePath = '';
            me.frameParentId = '';
            let action = {
                pageid: data.pageid,
                target: data.target
            };
            me.pageLinkAction(action);
        });
    }
    /**刷新标题 */
    let freshTitle = function () {
        if (type == 'month') {
            calendar_box.find('header > h4').text(year + '年' + month + '月');
        } else {
            calendar_box.find('header > h4').text(year + '年');
        }
    };

    let prePage = function () {
        if (type == 'month') {
            if (month == 1) {
                year -= 1;
                month = 12;
            } else {
                month -= 1;
            }
            refreshDateTable();
        } else {
            //year
            year -= 1;
            refreshMonthTable();
        }
        freshTitle();
    };
    let nextPage = function () {
        if (type == 'month') {
            if (month == 12) {
                year += 1;
                month = 1;
            } else {
                month += 1;
            }
            refreshDateTable();
        } else {
            //year
            year += 1;
            refreshMonthTable();
        }
        freshTitle();
    };
    let todayPage = function () {
        if (type == 'month') {
            year = new Date().getFullYear();
            month = new Date().getMonth() + 1;
            refreshDateTable();
        } else {
            //year
            year = new Date().getFullYear();
            refreshMonthTable();
        }
        freshTitle();
    }

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Style: v.attributes.Style,
                Date: v.attributes.Date,
                target: v.attributes.target,
                pageid: v.attributes.pageid
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Style: v.Style,
                    Date: v.Date,
                    target: v.target,
                    pageid: v.pageid
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    /**
     * 加载元素链接的容器框架设置项
     * @param {any} editor
     * @param {any} frameid
     * @param {any} combo jquery-dom  $('#domid')
     */
    me.loadElementLinkTargetFrames = function (editor, frameid, combo) {
        let data = [];
        let frame_exist = false;
        $.each(editor.Frames, function (n, v) {
            let text = (v.name == '') ? '未命名' : v.name;
            if (frame_exist == false) {
                if (v.id == frameid) {
                    frame_exist = true;
                }
            }
            data.push({
                id: v.id,
                text: text
            });
        });
        combo.combobox('loadData', data);
        if (frame_exist == true) {
            combo.combobox('setValue', frameid);
        } else {
            combo.combobox('clear');
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(900);
        me.setLayoutH(600);
        let today = new Date().getFullYear() + '-' + (new Date().getMonth() + 1) + '-' + new Date().getDate();
        me.Attribute.SchemeViewUiCalendar = {
            Date: today,
            Type: 'month',
            YearMonthTab: true,
            Focus: true,
            Items: [{
                Text: '这是一段文本。',
                Style: 'success',
                Date: today
            }]
        };
        initCalendar();
    };
    me.loadChildClass = function (cfg) {
        initCalendar();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initCalendar();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
SchemeViewUiCalendarComponent.prototype = Object.create(Element.prototype);
SchemeViewUiCalendarComponent.prototype.constructor = SchemeViewUiCalendarComponent;
