let SchemeElementUiCheckGroupComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi选项组';
    selfconfig.elType = "SchemeElementUiCheckGroup";
    selfconfig.src = 'scheme_elementui/checkgroup';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let checkgroup_box = $("<div></div>");
    me.FONT_COLOR = { ColorR: 81, ColorG: 90, ColorB: 110, A: 1 };

    let initCheckGroup = function () {
        me.addElement(checkgroup_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        if (config.params) {
            me.Attribute.SchemeElementUiCheckGroup.Style = config.params.style;
        }
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新选项样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        checkgroup_box.html('');
        if (me.Attribute.SchemeElementUiCheckGroup.Outline == true) {
            checkgroup_box.attr('class', 'componentstyle-schemeelementui-checkgroup-outline');
        } else {
            checkgroup_box.attr('class', 'componentstyle-schemeelementui-checkgroup');
        }
        let items_count = me.Attribute.SchemeElementUiCheckGroup.Items.length;
        let label_w = pos.W / items_count + items_count - 1;
        label_w = (pos.W + (items_count / 2)) / items_count;
        $.each(me.Attribute.SchemeElementUiCheckGroup.Items, function (n, v) {
            let label_x = 0;
            if (n > 0) {
                label_x = n * (label_w - 1);
            }
            let label = $('<label></label>');
            checkgroup_box.append(label);
            label.css('width', label_w + 'px');
            label.css('height', pos.H + 'px');
            label.css('left', label_x + 'px');

            let input = $('<input/>');
            if (me.Attribute.SchemeElementUiCheckGroup.Radio == true) {
                input.attr('type', 'radio');
                input.attr('name', 'radio' + me.id);
            } else {
                input.attr('type', 'checkbox');
            }
            label.append(input);
            if (v.Checked == true) {
                input.attr('checked', 'checked');
            } else {
                input.removeAttr('checked');
            }
            if (v.Disabled == true) {
                input.attr('disabled', 'disabled');
            } else {
                input.removeAttr('disabled');
            }

            let txt = $('<span></span>');
            label.append(txt);
            txt.css('width', label_w + 'px');
            txt.css('height', pos.H + 'px');
            txt.css('line-height', pos.H + 'px');
            txt.css('left', label_x + 'px');
            //txt.css('left', label_x - 1 + 'px');
            txt.text(v.Text);
        });

    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Disabled: v.attributes.Disabled,
                Checked: v.attributes.Checked
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Disabled: v.Disabled,
                    Checked: v.Checked
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(240);
        me.setLayoutH(32);
        me.Attribute.SchemeElementUiCheckGroup = {
            Radio: false,
            Outline: false,
            Items: [{
                Text: '上海',
                Disabled: false,
                Checked: true
            }, {
                Text: '北京',
                Disabled: false,
                Checked: false
            }, {
                Text: '广州',
                Disabled: false,
                Checked: false
            }, {
                Text: '深圳',
                Disabled: false,
                Checked: false
            }]
        };
        initCheckGroup();
    };
    me.loadChildClass = function (cfg) {
        initCheckGroup();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initCheckGroup();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
