let SchemeElementUiTextBoxComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi输入框';
    selfconfig.elType = "SchemeElementUiTextBox";
    selfconfig.src = 'scheme_elementui/textbox';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let input_box = $("<div></div>");
    let min_h = 28;

    let initTextBox = function () {
        me.setOverflow('visible');
        me.addElement(input_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let input_w = pos.W;
        let h = Math.max(pos.H - 2, 0);
        let top = 0;
        if (pos.H < min_h) {
            top = (pos.H - min_h) / 2;
        }

        input_box.html('');
        input_box.attr('class', '');
        input_box.addClass('componentstyle-schemeelementui-textbox');
        input_box.css('top', top + 'px');
        input_box.css('width', pos.W + 'px');
        input_box.css('height', pos.H + 'px');

        let icon_prefix = $('<span></span>');
        input_box.append(icon_prefix);
        icon_prefix.css('height', pos.H + 'px');
        icon_prefix.css('line-height', pos.H + 'px');

        let input = $('<input />');
        input_box.append(input);
        if (me.Attribute.SchemeElementUiTextBox.Password == true) {
            input.attr('type', 'password');
        } else {
            input.attr('type', 'text');
        }
        input.css('height', pos.H + 'px');
        input.css('line-height', h + 'px');
        input.attr('placeholder', me.Attribute.SchemeElementUiTextBox.PlaceHolder);
        input.attr('maxlength', me.Attribute.SchemeElementUiTextBox.CountLimit);
        input.val(me.Attribute.SchemeElementUiTextBox.Text);

        let counter = $('<counter>1/10</counter>');
        input_box.append(counter);
        counter.css('height', pos.H + 'px');
        counter.css('line-height', pos.H + 'px');

        let btn_clear = $('<a><i>×</i></a>');
        input_box.append(btn_clear);
        btn_clear.css('top', (pos.H - 20) / 2 + 'px');

        if (me.Attribute.SchemeElementUiTextBox.Icon) {
            let img = $(me.Attribute.SchemeElementUiTextBox.Icon);
            icon_prefix.append(img);
            input_w = pos.W - 40;
            input.css('border-top-left-radius', 0);
            input.css('border-bottom-left-radius', 0);
        } else {
            icon_prefix.css('display', 'none');
            input.css('left', '0');
        }
        if (me.Attribute.SchemeElementUiTextBox.CountEnabled == true) {
            input.css('padding-right', '50px');
            let c = input.val().length;
            counter.text(c + '/' + me.Attribute.SchemeElementUiTextBox.CountLimit);
        } else {
            input.css('padding-right', '7px');
            counter.css('display', 'none');
        }

        input.css('width', input_w + 'px');

        if (me.Attribute.SchemeElementUiTextBox.Disabled == true) {
            input.attr('disabled', 'disabled');
        } else {
            input.removeAttr('disabled');
            input.on('keyup', function () {
                let txt = $(this).val();
                counter.text(txt.length + '/' + me.Attribute.SchemeElementUiTextBox.CountLimit);
                if (me.Attribute.SchemeElementUiTextBox.ClearButton == true && input.val() != '') {
                    btn_clear.css('display', 'block');
                }
                if (txt.length > me.Attribute.SchemeElementUiTextBox.CountLimit) {
                    return false;
                }
            });
        }
        btn_clear.on('click', function () {
            input.val('');
            btn_clear.css('display', 'none');
        });
        if (me.Attribute.SchemeElementUiTextBox.ClearButton == true) {
            input_box.hover(function () {
                let disabled = input.attr('disabled');
                if (disabled) { return; }
                if (input.val() != '') {
                    btn_clear.css('display', 'block');
                }
            }, function () {
                btn_clear.css('display', 'none');
            });
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(40);
        me.Attribute.SchemeElementUiTextBox = {
            Text: '',
            PlaceHolder: '请输入内容',
            Disabled: false,
            Icon: undefined,
            Password: false,
            CountEnabled: true,
            CountLimit: 10,
            ClearButton: true
        };
        initTextBox();
    };
    me.loadChildClass = function (cfg) {
        initTextBox();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initTextBox();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
