let SchemeElementUiRateComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi评分';
    selfconfig.elType = "SchemeElementUiRate";
    selfconfig.src = 'scheme_elementui/rate';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let rate_box = $('<ul class="componentstyle-schemeelementui-rate"></ul>');
    let BG_COLOR = { ColorR: 198, ColorG: 209, ColorB: 222, A: 1 };

    let initRate = function () {
        me.addElement(rate_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '1');
        }

        if (config.params && config.params.url) {
            WidgetIcon.getIconCodeFromUrl(config.params.url, function (image) {
                me.Attribute.SchemeElementUiRate.Icon = image;
                me.loadChildren();
                me.refreshStyle();
            });
        } else {
            me.loadChildren();
            me.refreshStyle();
        }

    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };
    let k = -1;
    /**刷新按钮样式 */
    me.refreshStyle = function () {
        k = me.Attribute.SchemeElementUiRate.Value;
        rate_box.html('');
        for (var i = 0; i < 5; i++) {
            let li = $('<li></li>');
            rate_box.append(li);
            let icon = $(me.Attribute.SchemeElementUiRate.Icon);
            li.append(icon);
            WidgetIcon.refreshIconStyle(icon, 0, me.Attribute.SchemeElementUiRate.Color, me.Attribute.SchemeElementUiRate.Color, null);
            let m = i + 1;
            li.on('click', function () {
                k = m;
                refreshColor(k);
            });
            li.hover(function () {
                refreshColor(m);
            }, function () {
                refreshColor(k);
            });
        }
        refreshColor(me.Attribute.SchemeElementUiRate.Value);
    };

    let refreshColor = function (m) {
        let color = WidgetColor.ColorObjectToCssCode(me.Attribute.SchemeElementUiRate.Color);
        let li_arr = rate_box.find('li');
        let icons = li_arr.find('svg');
        WidgetIcon.refreshIconStyle(icons, 0, BG_COLOR, BG_COLOR, null);

        $.each(li_arr, function (n, v) {
            if (n < m) {
                let icon = $(v).find('svg');
                WidgetIcon.refreshIconStyle(icon, 0, color, color, null);
            } else { return false; }
        });
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(170);
        me.setLayoutH(40);
        me.Attribute.SchemeElementUiRate = {
            Value: 3,
            Color: { ColorR: 247, ColorG: 186, ColorB: 42, A: 1 }
        };
        initRate();
    };
    me.loadChildClass = function (cfg) {
        initRate();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initRate();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
