let SchemeElementUiTransferComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi穿梭框';
    selfconfig.elType = "SchemeElementUiTransfer";
    selfconfig.src = 'scheme_elementui/transfer';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let transfer_box = $('<div class="componentstyle-schemeelementui-transfer"></div>');
    let transfer_source = $('<div class="componentstyle-schemeelementui-transfer-list"></div>');
    let transfer_target = $('<div class="componentstyle-schemeelementui-transfer-list"></div>');
    let transfer_operation = $('<div class="componentstyle-schemeelementui-transfer-operation"></div>');
    let header_h = 40;


    let initTransfer = function () {
        me.addElement(transfer_box);
        transfer_box.append(transfer_source);
        transfer_box.append(transfer_operation);
        transfer_box.append(transfer_target);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '9');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let op_w = 182;
        if (pos.W < op_w) { op_w = pos.W; }
        let w = (pos.W - op_w) / 2;
        let h = pos.H - header_h - 2;
        refreshList(transfer_source, me.Attribute.SchemeElementUiTransfer.SourceTitle, me.Attribute.SchemeElementUiTransfer.SourceItems, w, h);

        refreshList(transfer_target, me.Attribute.SchemeElementUiTransfer.TargetTitle, me.Attribute.SchemeElementUiTransfer.TargetItems, w, h);

        refreshOperation(pos.H / 2 - 30);

        if (isview == true) {
            bindSource();
            bindTarget();
        }

    };
    let refreshList = function (list_box, title, items, width, height) {
        list_box.html('');
        list_box.css('width', width + 'px');
        let header = $('<div class="componentstyle-schemeelementui-transfer-list-header"></div>');
        list_box.append(header);

        let label = $('<label></label>');
        header.append(label);
        let input = $('<input type="checkbox" />');
        label.append(input);
        let checkall_box = $('<i class="fa fa-check"></i>');
        label.append(checkall_box);
        let title_span = $('<span></span>');
        label.append(title_span);
        title_span.text(title);

        let counter = $('<span></span>');
        header.append(counter);
        counter.text(items.length);

        let body = $('<div class="componentstyle-schemeelementui-transfer-list-body"></div>');
        list_box.append(body);
        body.css('height', height + 'px');
        $.each(items, function (n, v) {
            let item_label = $('<label></label>');
            body.append(item_label);
            let item_label_input = $('<input type="checkbox" />');
            item_label.append(item_label_input);
            if (v.Disabled == true) {
                item_label_input.attr('disabled', true);
            } else {
                item_label_input.removeAttr('disabled');
            }

            let check_icon = $('<i class="fa fa-check"></i>');
            item_label.append(check_icon);

            let item_label_span = $('<span></span>');
            item_label.append(item_label_span);
            item_label_span.text(v.Text);
        });
        input.unbind('click');
        input.on('click', function () {
            let checked = input.attr('dd');
            if (checked) {
                body.find('input').removeAttr('checked');
                body.find('input').removeAttr('dd');
                input.removeAttr('dd');
            } else {
                body.find('input:not(:disabled)').prop('checked', true);
                body.find('input:not(:disabled)').attr('dd', true);
                input.attr('dd', true);
            }
            refreshCounter_source();
            refreshCounter_target();
        });
    };
    let refreshOperation = function (top) {
        transfer_operation.html('');
        let btn_left = $('<label></label>');
        transfer_operation.append(btn_left);
        transfer_operation.css('margin-top', top + 'px');

        let btn_left_input = $('<input type="checkbox" disabled />');
        btn_left.append(btn_left_input);
        btn_left.append($('<i class="fa fa-angle-left"></i>'));

        btn_left_input.on('click', function () {
            //从源到目的
            let checkedList = transfer_target.find('.componentstyle-schemeelementui-transfer-list-body >label> input[dd=true]');
            $.each(checkedList, function (n, v) {
                $(v).parent().remove();
                transfer_source.find('.componentstyle-schemeelementui-transfer-list-body').append($(v).parent());
            });
            transfer_box.find('input[type="checkbox"]').removeAttr('checked');
            transfer_box.find('input[type="checkbox"]').removeAttr('dd');
            btn_left_input.attr('disabled', true);
            refreshCounter_source();
            refreshCounter_target();
            bindSource();
            bindTarget();
        });


        let btn_right = $('<label></label>');
        transfer_operation.append(btn_right);
        let btn_right_input = $('<input type="checkbox" disabled />');
        btn_right.append(btn_right_input);
        btn_right.append($('<i class="fa fa-angle-right"></i>'));

        btn_right_input.on('click', function () {
            //从源到目的
            let checkedList = transfer_source.find('.componentstyle-schemeelementui-transfer-list-body >label> input[dd=true]');
            $.each(checkedList, function (n, v) {
                $(v).parent().remove();
                transfer_target.find('.componentstyle-schemeelementui-transfer-list-body').append($(v).parent());
            });
            transfer_box.find('input[type="checkbox"]').removeAttr('checked');
            transfer_box.find('input[type="checkbox"]').removeAttr('dd');
            btn_right_input.attr('disabled', true);
            refreshCounter_source();
            refreshCounter_target();
            bindSource();
            bindTarget();
        });
    };
    let bindSource = function () {
        let checkboxList_source = transfer_source.find('.componentstyle-schemeelementui-transfer-list-body >label> input');
        $.each(checkboxList_source, function (n, v) {
            $(v).unbind('click');
            $(v).on('click', function () {
                let dd = $(v).attr('dd');
                if (dd) {
                    $(v).removeAttr('dd');
                } else {
                    $(v).attr('dd', true);
                }
                refreshCounter_source();
                bindSource();
                bindTarget();
            });
        });
    };

    let bindTarget = function () {
        let checkboxList_target = transfer_target.find('.componentstyle-schemeelementui-transfer-list-body >label> input');
        //checkboxList_target.unbind('click');
        $.each(checkboxList_target, function (n, v) {
            $(v).unbind('click');
            $(v).on('click', function () {
                let dd = $(v).attr('dd');
                if (dd) {
                    $(v).removeAttr('dd');
                } else {
                    $(v).attr('dd', true);
                }
                refreshCounter_target();

                //$(v).click();
                bindSource();
                bindTarget();
            });
        });
    };
    /**刷新源列表计数 */
    let refreshCounter_source = function () {
        let checkboxList_source = transfer_source.find('.componentstyle-schemeelementui-transfer-list-body >label> input');
        let checkedList = transfer_source.find('.componentstyle-schemeelementui-transfer-list-body >label> input[dd=true]');
        let right_btn = transfer_operation.find('label>input')[1];
        if (checkedList.length > 0) {
            transfer_source.find('.componentstyle-schemeelementui-transfer-list-header > span').text(checkedList.length + ' / ' + checkboxList_source.length);
        } else {
            transfer_source.find('.componentstyle-schemeelementui-transfer-list-header > span').text(checkboxList_source.length);
        }
        if (checkedList.length > 0) {
            $(right_btn).removeAttr('disabled');
        } else {
            $(right_btn).attr('disabled', true);
        }
    }
    /**刷新目标列表计数 */
    let refreshCounter_target = function () {
        let checkboxList_target = transfer_target.find('.componentstyle-schemeelementui-transfer-list-body >label> input');
        let checkedList = transfer_target.find('.componentstyle-schemeelementui-transfer-list-body >label> input[dd=true]');
        let left_btn = transfer_operation.find('label>input')[0];
        if (checkedList.length > 0) {
            transfer_target.find('.componentstyle-schemeelementui-transfer-list-header > span').text(checkedList.length + ' / ' + checkboxList_target.length);
        } else {
            transfer_target.find('.componentstyle-schemeelementui-transfer-list-header > span').text(checkboxList_target.length);
        }
        if (checkedList.length > 0) {
            $(left_btn).removeAttr('disabled');
        } else {
            $(left_btn).attr('disabled', true);
        }
    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Disabled: v.attributes.Disabled
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Disabled: v.Disabled
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(600);
        me.setLayoutH(300);
        me.Attribute.SchemeElementUiTransfer = {
            SearchBox: true,
            SourceTitle: '列表1',
            TargetTitle: '列表2',
            SourceItems: [{
                Text: '备选项1',
                Checked: false,
                Disabled: false
            }, {
                Text: '备选项2',
                Checked: false,
                Disabled: true
            }, {
                Text: '备选项3',
                Checked: false,
                Disabled: false
            }],
            TargetItems: [{
                Text: '备选项4',
                Checked: false,
                Disabled: false
            }, {
                Text: '备选项5',
                Checked: false,
                Disabled: false
            }, {
                Text: '备选项6',
                Checked: false,
                Disabled: false
            }]
        };
        initTransfer();
    };
    me.loadChildClass = function (cfg) {
        initTransfer();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initTransfer();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
SchemeElementUiTransferComponent.prototype = Object.create(Element.prototype);
SchemeElementUiTransferComponent.prototype.constructor = SchemeElementUiTransferComponent;
