let SchemeElementUiNotificationComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi通知';
    selfconfig.elType = "SchemeElementUiNotification";
    selfconfig.src = 'scheme_elementui/notification';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;

    let message_box = $('<div></div>');
    let ICON_STYLE = {
        'info': 'info-circle',
        'success': 'check-circle',
        'warn': 'exclamation-circle',
        'error': 'times-circle',
    };

    let initNotify = function () {
        me.setOverflow('visible');
        me.addElement(message_box);
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    }

    /**刷新样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let title_h = 52;
        message_box.html('');
        message_box.attr('class', 'componentstyle-schemeelementui-notification');
        message_box.css('width', pos.W + 'px');
        message_box.css('height', pos.H + 'px');
        let style = me.Attribute.SchemeElementUiNotification.Style;
        message_box.addClass('componentstyle-schemeelementui-notification-' + style);
        let i = $('<i></i>');
        message_box.append(i);
        i.attr('class', 'fa fa-' + ICON_STYLE[style]);
        let span = $('<span></span>');
        span.text(me.Attribute.SchemeElementUiNotification.Text);
        message_box.append(span);

        let p = $('<p></p>');
        message_box.append(p);
        p.css('height', pos.H - title_h + 'px');
        p.text(me.Attribute.SchemeElementUiNotification.Desc);

        let close_btn = $('<a href="javascript:;">×</a>');
        message_box.append(close_btn);


        if (isview == true) {
            message_box.css('display', 'none');
            let container_w = me.container.outerWidth();
            let container_h = me.container.outerHeight();
            let scroll_x = me.container.scrollLeft();
            let scroll_y = me.container.scrollTop();
            if (me.container.attr('id') == 'viewer') {
                container_w = me.container.parent().outerWidth();
                scroll_x = me.container.parent().scrollLeft();
                container_h = me.container.parent().outerHeight();
                scroll_y = me.container.parent().scrollTop();
            }
            me.container.append(message_box);
            let left, top;
            let left_start, top_start;
            switch (me.Attribute.SchemeElementUiNotification.Position) {
                case 'right-top':
                    left_start = scroll_x + container_w;
                    left = left_start - pos.W - 30;
                    top = scroll_y + 10;
                    break;
                case 'right-bottom':
                    left_start = scroll_x + container_w;
                    left = left_start - pos.W - 30;
                    top = scroll_y + container_h - pos.H - 30;
                    break;
                case 'left-bottom':
                    left_start = scroll_x - pos.W;
                    left = left_start + pos.W + 10;
                    top = scroll_y + container_h - pos.H - 30;
                    break;
                case 'left-top':
                    left_start = scroll_x - pos.W;
                    left = left_start + pos.W + 10;
                    top = scroll_y + 10;
                    break;
            }

            message_box.css('position', 'absolute');
            message_box.css('left', left_start + 'px');
            message_box.css('top', top + 'px');

            if (me.Attribute.Layout.Hide == false) {
                message_box.css('display', 'block');
                message_box.css('z-index', 99999);

                message_box.animate({ left: left + 'px' }, 500, function () {
                    setTimeout(function () {
                        message_box.animate({ left: left_start + 'px' }, 500, function () {
                            message_box.css('display', 'none');
                        });
                    }, me.Attribute.SchemeElementUiNotification.Time * 1000);
                });
            }
            close_btn.on('click', function () {
                message_box.animate({ left: left_start + 'px' }, 500, function () {
                    message_box.css('display', 'none');
                });
            });
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(360);
        me.setLayoutH(160);
        me.Attribute.SchemeElementUiNotification = {
            Text: '这是一个ElementUI的通知',
            Desc: '悬浮出现在页面角落，显示全局的通知提醒消息。',
            Style: 'info',
            Time: 3,
            Position: 'right-top',
            CloseBtn: false
        };
        initNotify();
    };
    me.loadChildClass = function (cfg) {
        initNotify();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initNotify();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
