SchemeElementUiStepBarComponent.prototype = Object.create(Element.prototype);
SchemeElementUiStepBarComponent.prototype.constructor = SchemeElementUiStepBarComponent;
let SchemeElementUiStepBarVerticalComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi垂直步骤条';
    selfconfig.elType = "SchemeElementUiStepBarVertical";
    selfconfig.src = 'scheme_elementui/stepbarvertical';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let stepbar_box = $('<ul class="componentstyle-schemeelementui-stepbarvertical"></ul>');
    /**成功步骤的颜色 */
    let COLOR_SUCCESS = {
        primary: '#409EFF',
        success: '#67C23A',
        warn: '#E6A23C'
    };
    /** 错误颜色 */
    let COLOR_ERROR = '#F56C6C';
    /** 默认颜色 */
    let COLOR_NORMAL = '#303133';

    let initStepBar = function () {
        me.addElement(stepbar_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        stepbar_box.html('');
        let items = me.Attribute.SchemeElementUiStepBarVertical.Items;
        let li_h = pos.H / items.length;
        let stepIndex = me.Attribute.SchemeElementUiStepBarVertical.CurrentStep - 1;
        $.each(items, function (n, v) {
            let li = $("<li></li>");
            stepbar_box.append(li);
            li.css('height', li_h + 'px');

            let i = $('<i></i>');
            li.append(i);

            let span = $('<span></span>');
            li.append(span);
            span.text(v.Text);

            let p = $('<p></p>');
            li.append(p);
            p.text(v.Desc);

            if (v.Icon) {
                i.css('border', 'rgba(255,255,255,0)');
                let img = $(v.Icon);
                i.append(img);
            }

            if (n > stepIndex) {
                //未运行
                if (!v.Icon) {
                    i.text(n + 1);
                }
            }
            else if (n == stepIndex) {
                //运行中
                li.addClass(me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle);
                if (me.Attribute.SchemeElementUiStepBarVertical.Error == true) {
                    //错误结果
                    if (v.Icon) {
                        i.css('border-width', '0');
                        i.find('svg').css('fill', COLOR_ERROR);
                        i.find('svg').css('stroke', COLOR_ERROR);
                    } else {
                        i.attr('class', 'fa fa-close');
                        i.css('border', 'solid 2px ' + COLOR_ERROR);
                        i.css('color', COLOR_ERROR);
                    }
                    i.css('background-color', '#fff');
                    span.css('font-weight', 700);
                    span.css('color', COLOR_ERROR);
                    p.css('color', COLOR_ERROR);
                }
                else {
                    if (v.Icon) {
                        i.css('border-width', '0');
                        i.find('svg').css('fill', COLOR_NORMAL);
                        i.find('svg').css('stroke', COLOR_NORMAL);
                    }
                    else {
                        i.text(n + 1);
                        i.css('border', 'solid 2px ' + COLOR_NORMAL);
                        i.css('color', COLOR_NORMAL);
                    }
                    i.css('background-color', '#fff');
                    span.css('font-weight', 700);
                    span.css('color', COLOR_NORMAL);
                    p.css('color', COLOR_NORMAL);
                }
            }
            else {
                //已运行
                li.addClass(me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle);
                if (v.Icon) {
                    i.find('svg').css('fill', COLOR_SUCCESS[me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle]);
                    i.find('svg').css('stroke', COLOR_SUCCESS[me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle]);
                    i.css('border-width', '0');
                } else {
                    i.html('');
                    i.attr('class', 'fa fa-check');
                    i.css('color', COLOR_SUCCESS[me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle]);
                    i.css('border', 'solid 2px ' + COLOR_SUCCESS[me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle]);
                }
                span.css('font-weight', 700);
                span.css('color', COLOR_SUCCESS[me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle]);
                p.css('color', COLOR_SUCCESS[me.Attribute.SchemeElementUiStepBarVertical.SuccessStyle]);
            }
        });
    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Desc: v.attributes.Desc,
                Icon: v.attributes.Icon,
                target: v.attributes.target,
                pageid: v.attributes.pageid
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Desc: v.Desc,
                    Icon: v.Icon,
                    target: v.target,
                    pageid: v.pageid
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(400);
        me.Attribute.SchemeElementUiStepBarVertical = {
            CurrentStep: 2,
            SuccessStyle: 'primary',
            Error: false,
            Items: [{
                Text: '已完成',
                Desc: '这里是该步骤的描述信息'
            }, {
                Text: '进行中',
                Desc: '这里是该步骤的描述信息'
            }, {
                Text: '待进行',
                Desc: '这里是该步骤的描述信息'
            }, {
                Text: '待进行',
                Desc: '这里是该步骤的描述信息'
            }]
        };
        initStepBar();
    };
    me.loadChildClass = function (cfg) {
        initStepBar();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initStepBar();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
SchemeElementUiStepBarComponent.prototype = Object.create(Element.prototype);
SchemeElementUiStepBarComponent.prototype.constructor = SchemeElementUiStepBarComponent;
let SchemeElementUiDialogComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi对话框';
    selfconfig.elType = "SchemeElementUiDialog";
    selfconfig.src = 'scheme_elementui/dialog';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let dialog_box = $('<div class="componentstyle-schemeelementui-dialog"></div>');
    let frame_body = $('<div></div>');
    let header_h = 46;
    let footer_h = 70;

    let initDialog = function () {
        me.setOverflow('visible');
        me.loadChildren();
        me.refreshStyle();
        me.refreshFooterFrame();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let box = me.getBox();
        dialog_box.html('');
        dialog_box.css('width', pos.W + 'px');
        dialog_box.css('height', pos.H + 'px');
        dialog_box.css('box-shadow', '0 1px 10px 0 rgba(0,0,0,.2)');

        let header = $('<header></header>');
        dialog_box.append(header);
        header.text(me.Attribute.SchemeElementUiDialog.Title);
        let close_btn = $('<i>×</i>');
        header.append(close_btn);
        let frame_body_h = pos.H - header_h - footer_h;

        dialog_box.append(frame_body);
        frame_body.css('position', 'relative');
        frame_body.css('width', '100%');
        frame_body.css('height', frame_body_h + 'px');
        if (me.Attribute.SchemeElementUiDialog.ShowScroll == true) {
            frame_body.css('overflow', 'auto');
        } else {
            frame_body.css('overflow', 'hidden');
        }

        let footer = $('<footer></footer>');
        dialog_box.append(footer);
        footer.css('text-align', me.Attribute.SchemeElementUiDialog.ButtonPosition);

        let button_items = me.Attribute.SchemeElementUiDialog.Buttons;
        $.each(button_items, function (n, v) {
            let btn = $("<button></button>");
            footer.append(btn);
            btn.attr('class', 'componentstyle-schemeelementui-dialog-btn');
            btn.text(v.Text);
            if (v.Outline == true) {
                btn.addClass('componentstyle-schemeelementui-dialog-btn-outline-' + v.Style);
            } else {
                btn.addClass('componentstyle-schemeelementui-dialog-btn-' + v.Style);
            }
            if (v.AllowClose == true) {
                btn.attr('allowclose', true);
            } else {
                btn.removeAttr('allowclose');
            }
            if (v.Disabled == true) {
                btn.attr('disabled', 'disabled');
            } else {
                btn.removeAttr('disabled');
            }
        });

        if (isview == true) {
            box.css('display', 'none');
            if (me.Attribute.Layout.Hide == true) { return; }
            let container_w = me.container.outerWidth();
            let container_h = me.container.outerHeight();
            let scroll_x = me.container.scrollLeft();
            let scroll_y = me.container.scrollTop();
            if (me.container.attr('id') == 'viewer') {
                container_w = me.container.parent().outerWidth();
                scroll_x = me.container.parent().scrollLeft();
                container_h = me.container.parent().outerHeight();
                scroll_y = me.container.parent().scrollTop();
            }
            let viewShade = $('<div class="viewShade"></div>');
            me.container.append(viewShade);
            viewShade.append(dialog_box);

            viewShade.css('display', 'block');
            viewShade.css('background-color', 'rgba(0,0,0,.5)');
            viewShade.css('position', 'absolute');
            viewShade.css('width', '100%');
            viewShade.css('height', '100%');
            viewShade.css('left', '0px');
            viewShade.css('top', '0px');
            viewShade.css('z-index', '99999');
            viewShade.unbind();
            if (me.Attribute.SchemeElementUiDialog.OnlyButtonClosed == false) {
                viewShade.on('click', function (e) {
                    hideDialog(viewShade, dialog_box);
                });
            }
            close_btn.unbind('click');
            close_btn.on('click', function (e) {
                e.stopPropagation();
                hideDialog(viewShade, dialog_box);
            });
            let footer_btns = footer.find('button[allowclose=true]');
            footer_btns.unbind('click');
            footer_btns.on('click', function (e) {
                e.stopPropagation();
                hideDialog(viewShade, dialog_box);
            });
            let frame_left = 0;
            let frame_top = 20;
            let frame_w = pos.W;
            let frame_h = pos.H;
            if (me.Attribute.SchemeElementUiDialog.OnCenter == false) {
                frame_top = scroll_y + 20;
                frame_left = scroll_x + container_w / 2 - pos.W / 2;

            } else {
                frame_left = scroll_x + container_w / 2 - pos.W / 2;
                frame_top = scroll_y + container_h / 2 - pos.H / 2;

            }
            dialog_box.on('click', function (e) {
                e.stopPropagation();
            })
            dialog_box.css('left', frame_left + 'px');
            dialog_box.css('top', frame_top + 'px');
            dialog_box.css('width', frame_w + 'px');
            dialog_box.css('opacity', 0);

            dialog_box.animate({
                opacity: 1
            }, 200, function () {
                dialog_box.css('opacity', 1);
                dialog_box.css('display', 'block');
            });
        } else {
            box.html('');
            box.append(dialog_box);
            let shade = $('<div></div>');
            box.append(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
    };
    /**
     * 隐藏对话框
     * @param {any} viewShadeDiv
     * @param {any} dialogDiv
     */
    let hideDialog = function (viewShadeDiv, dialogDiv) {

        dialogDiv.animate({
            top: '0px',
            opacity: 0
        }, 200, function () {
            viewShadeDiv.animate({
                opacity: 0
            }, 200, function () {
                viewShadeDiv.remove();
            });
        });
    }
    /**
     * 加载元素链接的容器框架设置项
     * @param {any} editor
     * @param {any} frameid
     * @param {any} combo jquery-dom  $('#domid')
     */
    me.loadElementLinkTargetFrames = function (editor, frameid, combo) {
        let data = [];
        let frame_exist = false;
        $.each(editor.Frames, function (n, v) {
            let text = (v.name == '') ? '未命名' : v.name;
            if (frame_exist == false) {
                if (v.id == frameid) {
                    frame_exist = true;
                }
            }
            data.push({
                id: v.id,
                text: text
            });
        });
        combo.combobox('loadData', data);
        if (frame_exist == true) {
            combo.combobox('setValue', frameid);
        } else {
            combo.combobox('clear');
        }
    };

    /**
     * 将树的数据转换为按钮数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Disabled: v.attributes.Disabled,
                Style: v.attributes.Style,
                Outline: v.attributes.Outline,
                AllowClose: v.attributes.AllowClose
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将按钮数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Disabled: v.Disabled,
                    Style: v.Style,
                    Outline: false,
                    AllowClose: true
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };
    me.refreshFooterFrame = function () {
        let pageid = me.Attribute.SchemeElementUiDialog.PageId;
        if (pageid) {
            let pageobj = me.project.getPage(pageid);
            if (pageobj) {
                me.pageJump(pageid, frame_body);
            } else {
                me.project.readPage(pageid, frame_body);
            }
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(600);
        me.setLayoutH(300);
        me.Attribute.SchemeElementUiDialog = {
            Title: '标题',
            Style: 'primary',
            Shadow: true,
            OnCenter: false,
            OnlyButtonClosed: false,
            PageId: undefined,
            ShowScroll: true,
            ButtonPosition: 'right',//left center right
            Buttons: [{
                Text: '取消',
                Disabled: false,
                Style: 'default',
                Outline: false,
                AllowClose: true
            }, {
                Text: '确定',
                Disabled: false,
                Style: 'primary',
                Outline: false,
                AllowClose: true
            }]
        };
        me.framePath = '';
        me.frameParentId = '';
        initDialog();
    };
    me.loadChildClass = function (cfg) {
        me.framePath = '';
        me.frameParentId = '';
        initDialog();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initDialog();
    };
    me.refreshChildView = function () {
        me.framePath = '';
        me.frameParentId = '';
        me.refreshStyle();
        me.refreshFooterFrame();
    };
};
