let SchemeElementUiCardComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi卡片';
    selfconfig.elType = "SchemeElementUiCard";
    selfconfig.src = 'scheme_elementui/card';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let cardbox = $('<div class="componentstyle-schemeelementui-card"></div>');
    let footer_framebox = $('<div></div>');
    let header_h = 58;

    let initCard = function () {
        me.setOverflow('visible');
        me.addElement(cardbox);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
        me.refreshFooterFrame();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        cardbox.html('');
        let header = $('<header></header>');
        cardbox.append(header);
        header.text(me.Attribute.SchemeElementUiCard.Title);

        let btn = $('<a href="javascript:;"></a>');
        header.append(btn);
        btn.text(me.Attribute.SchemeElementUiCard.Button);

        let footer_h = pos.H - header_h;
        let footer = $('<footer></footer>');
        cardbox.append(footer);
        footer.css('height', footer_h + 'px');
        footer.append(footer_framebox);
        footer_framebox.css('position', 'relative');
        footer_framebox.css('width', '100%');
        footer_framebox.css('height', '100%');
        footer_framebox.css('overflow', 'hidden');

        if (me.Attribute.SchemeElementUiCard.Shadow == true) {
            cardbox.addClass('componentstyle-schemeelementui-card-shadow');
        } else {
            cardbox.removeClass('componentstyle-schemeelementui-card-shadow');
        }
    };
    /**
     * 加载元素链接的容器框架设置项
     * @param {any} editor
     * @param {any} frameid
     * @param {any} combo jquery-dom  $('#domid')
     */
    me.loadElementLinkTargetFrames = function (editor, frameid, combo) {
        let data = [];
        let frame_exist = false;
        $.each(editor.Frames, function (n, v) {
            let text = (v.name == '') ? '未命名' : v.name;
            if (frame_exist == false) {
                if (v.id == frameid) {
                    frame_exist = true;
                }
            }
            data.push({
                id: v.id,
                text: text
            });
        });
        combo.combobox('loadData', data);
        if (frame_exist == true) {
            combo.combobox('setValue', frameid);
        } else {
            combo.combobox('clear');
        }
    };
    me.refreshFooterFrame = function () {
        let pageid = me.Attribute.SchemeElementUiCard.FooterPageId;
        if (pageid && pageid != '') {
            let pageobj = me.project.getPage(pageid);
            if (pageobj) {
                me.pageJump(pageid, footer_framebox);
            } else {
                me.project.readPage(pageid, footer_framebox);
            }
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(400);
        me.setLayoutH(260);
        me.Attribute.SchemeElementUiCard = {
            Title: '标题',
            Button: '操作按钮',
            Shadow: true,
            FooterPageId: ''
        };
        me.framePath = '';
        me.frameParentId = '';
        initCard();
    };
    me.loadChildClass = function (cfg) {
        me.framePath = '';
        me.frameParentId = '';
        initCard();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initCard();
    };
    me.refreshChildView = function () {
        me.framePath = '';
        me.frameParentId = '';
        me.refreshStyle();
        me.refreshFooterFrame();
    };
};
