SchemeElementUiCardComponent.prototype.constructor = SchemeElementUiCardComponent;
let SchemeElementUiCarouselComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi走马灯';
    selfconfig.elType = "SchemeElementUiCarousel";
    selfconfig.src = 'scheme_elementui/carousel';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let timer;
    let btns_h = 35;

    let carousel_box = $('<div class="componentstyle-schemeelementui-carousel"></div>');

    let initCarouse = function () {
        me.addElement(carousel_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };
    /**刷新样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        carousel_box.html('');
        let h = pos.H;

        let btn_pre = $('<a href="javascript:;" class="fa fa-angle-left"></a>');
        carousel_box.append(btn_pre);
        btn_pre.css('left', '16px');
        btn_pre.on('click', function () {
            switchImages_pre(pos.W);
        });

        let list = $('<div></div>');
        carousel_box.append(list);

        let btn_next = $('<a href="javascript:;" class="fa fa-angle-right"></a>');
        carousel_box.append(btn_next);
        btn_next.css('right', '16px');
        btn_next.on('click', function () {
            switchImages_next(pos.W);
        });

        let btn_list = $('<ul></ul>');
        carousel_box.append(btn_list);
        if (me.Attribute.SchemeElementUiCarousel.IndicatorPosition == 'outer') {
            h = pos.H - btns_h;
            carousel_box.css('height', h + 'px');
            btn_list.css('bottom', 0 - btns_h + 'px');
        } else if (me.Attribute.SchemeElementUiCarousel.IndicatorPosition == 'hidden') {
            btn_list.css('display', 'none');
            carousel_box.css('height', h + 'px');
        } else {
            carousel_box.css('height', h + 'px');
            btn_list.css('bottom', '10px');
        }

        $.each(me.Attribute.SchemeElementUiCarousel.Items, function (n, v) {
            let span = $('<span></span>');
            list.append(span);
            span.text(v.Text);
            span.attr('data', n);
            span.css('width', pos.W + 'px');
            span.css('height', h + 'px');
            span.css('line-height', h + 'px');
            span.css('background-color', WidgetColor.ColorObjectToCssCode(v.BgColor));
            if (v.Image) {
                span.css('background-image', 'url(' + v.Image + ')');
            }

            let btn = $('<li></li>');
            btn_list.append(btn);
            btn.on(me.Attribute.SchemeElementUiCarousel.IndicatorActionType, function () {
                gotoImage(pos.W, n);
            });
        });
        updateBtnStatus();
        if (isview == true) {
            if (timer) {
                clearTimeout(timer);
            }
            if (me.Attribute.SchemeElementUiCarousel.AutoSwitch == true) {
                autoSwitch(pos.W);
            }
        }
        if (me.Attribute.SchemeElementUiCarousel.Arrow == 'hover') {
            btn_pre.css('display', 'none');
            btn_next.css('display', 'none');
            carousel_box.hover(function () {
                btn_pre.css('display', 'block');
                btn_next.css('display', 'block');
            }, function () {
                btn_pre.css('display', 'none');
                btn_next.css('display', 'none');
            });
        } else if (me.Attribute.SchemeElementUiCarousel.Arrow == 'visible') {
            btn_pre.css('display', 'block');
            btn_next.css('display', 'block');
        } else {
            btn_pre.css('display', 'none');
            btn_next.css('display', 'none');
        }
    };
    /**自动切换 */
    let autoSwitch = function (w) {
        switchImages_pre(w);
        timer = setTimeout(function () {
            autoSwitch(w);
        }, 2000);
    };
    /**
     * 向前翻
     * @param {any} w
     */
    let switchImages_pre = function (w) {
        let items = carousel_box.children('div').children();
        let el_first = $(items[0]);
        let el_last = $(items[items.length - 1]);
        if (items.length > 1) {
            el_first.animate({ width: 0 }, 200, function () {
                el_first.insertAfter(el_last);
                el_first.css('width', w + 'px');
                updateBtnStatus();
            });
        }
    };
    /**
     * 向后翻
     * @param {any} w
     */
    let switchImages_next = function (w) {
        let items = carousel_box.children('div').children();
        let el_first = $(items[0]);
        let el_last = $(items[items.length - 1]);
        if (items.length > 1) {
            el_last.css('width', 0);
            el_last.insertBefore(el_first);
            el_last.animate({ width: w + 'px' }, 200, function () {
                updateBtnStatus();
            });
        }
    };
    /**
     * 跳转到某处
     * @param {any} w
     * @param {any} n
     */
    let gotoImage = function (w, n) {
        let cn = getCurrentBtnIndex();
        if (cn != n) {
            switchImages_pre(w);
            cn = getCurrentBtnIndex();
            setTimeout(gotoImage, 200, w, n);
        }
    };
    /**获取当前切换按钮索引 */
    let getCurrentBtnIndex = function () {
        let el_first = carousel_box.children('div').children().first();
        let n = el_first.attr('data');
        return n;
    };
    /**更新切换按钮状态 */
    let updateBtnStatus = function () {
        let el_first = carousel_box.children('div').children().first();
        let n = el_first.attr('data');
        let btns = carousel_box.children('ul').children('li');
        btns.css('opacity', '.3');
        let btn = $(btns[n]);
        btn.css('opacity', 1);
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(340);
        me.setLayoutH(150);
        me.Attribute.SchemeElementUiCarousel = {
            AutoSwitch: false,
            IndicatorPosition: 'inner',
            IndicatorActionType: 'click',
            Arrow: 'hover',
            Items: [{
                Text: '1',
                BgColor: { ColorR: 221, ColorG: 220, ColorB: 230, A: 1 },
                Image: null
            }, {
                Text: '2',
                BgColor: { ColorR: 153, ColorG: 169, ColorB: 191, A: 1 },
                Image: null
            }, {
                Text: '3',
                BgColor: { ColorR: 235, ColorG: 226, ColorB: 226, A: 1 },
                Image: null
            }]
        };
        initCarouse();
    };
    me.loadChildClass = function (cfg) {
        initCarouse();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initCarouse();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
