let SchemeElementUiBackTopComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUi返回顶部';
    selfconfig.elType = "SchemeElementUiBackTop";
    selfconfig.src = 'scheme_elementui/backtop';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let btn = $('<div></div>');

    let initBtn = function () {
        me.addElement(btn);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', 1);
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let box = me.getBox();
        let w = 40;
        let h = 40;
        let top = (pos.H - h) / 2;
        if (top < 0) { top = 0; }
        let left = (pos.W - w) / 2;
        if (left < 0) { left = 0; }
        btn.html('');
        btn.removeAttr('style');
        btn.attr('class', 'componentstyle-schemeelementui-backtop');
        btn.addClass('componentstyle-schemeelementui-backtop-' + me.Attribute.SchemeElementUiBackTop.Style);
        btn.append($('<i class="fa fa-caret-up"><i>'));
        if (me.Attribute.SchemeElementUiBackTop.Circle == true) {
            btn.css('border-radius', '50%');
        }

        if (isview == true) {
            let min_height = 10;
            btn.css('transition', 'all .2s ease-in-out;');
            me.container.append(btn);
            btn.css('position', 'absolute');
            btn.css('left', 'unset');
            btn.css('top', '0px');

            btn.css('display', 'none');
            btn.on('click', function () {
                me.container.animate({ scrollTop: 0 }, 700);
            });
            let scroller_box = me.container.parent();
            scroller_box.scroll(function (e) {
                let container_w = scroller_box.outerWidth();
                let container_h = scroller_box.outerHeight();
                let scroll_x = scroller_box.scrollLeft();
                let scroll_y = scroller_box.scrollTop();

                let btn_top = scroll_y + container_h - 100;
                let btn_left = scroll_x + container_w - 100;
                btn.css('left', btn_left + 'px');
                btn.css('top', btn_top + 'px');
                if (scroll_y > min_height) {
                    btn.fadeIn(100);
                } else {
                    btn.fadeOut(200);
                }
            });
            btn.on('click', function () {
                scroller_box.animate({ scrollTop: 0 }, 700);
            });
            box.remove();
        } else {
            btn.css('position', 'absolute');
            btn.css('left', left + 'px');
            btn.css('top', top + 'px');
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(80);
        me.setLayoutH(80);
        me.Attribute.SchemeElementUiBackTop = {
            Style: 'light',//dark primary light info warning error
            Circle: true
        };
        initBtn();
    };
    me.loadChildClass = function (cfg) {
        initBtn();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initBtn();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
