let SchemeElementUiDrawerComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'ElementUI抽屉';
    selfconfig.elType = "SchemeElementUiDrawer";
    selfconfig.src = 'scheme_elementui/drawer';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;

    let frame = $("<div></div>");
    let title_h = 50;

    let initMaskLayer = function () {
        me.loadChildren();
        me.refreshStyle();
        me.refreshViewFrame();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };
    /**刷新容器页面 */
    me.refreshViewFrame = function () {
        let pageid = me.Attribute.SchemeElementUiDrawer.PageId;
        if (pageid && pageid != '') {
            let pageobj = me.project.getPage(pageid);
            if (pageobj) {
                me.pageJump(pageid, frame);
            } else {
                me.project.readPage(pageid, frame);
            }
        }
        frame.css('background-color', '#fff');
        frame.css('overflow', me.Attribute.SchemeElementUiDrawer.ScrollBar);
    };

    /**刷新样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let box = me.getBox();
        box.html('');
        let title = $('<div></div>');
        if (me.Attribute.SchemeElementUiDrawer.ShowTitle == true) {
            title.css('display', 'block');
            title_h = 50;
        }
        else {
            title.css('display', 'none');
            title_h = 0;
        }
        title.css('position', 'absolute');
        title.css('height', title_h + 'px');
        title.css('line-height', title_h + 'px');
        title.css('padding-left', '5px');
        title.css('background-color', '#fff');
        title.css('font-size', '16px');
        title.css('color', '#72767b');
        title.text(me.Attribute.SchemeElementUiDrawer.Title);

        let closeBtn = $('<div>×</div>');
        title.append(closeBtn);
        closeBtn.css('float', 'right');
        closeBtn.css('width', title_h + 'px');
        closeBtn.css('height', title_h + 'px');
        closeBtn.css('line-height', title_h + 'px');
        closeBtn.css('font-size', '24px');
        closeBtn.css('cursor', 'pointer');
        closeBtn.css('font-weight', '100');
        closeBtn.css('text-align', 'center');

        frame.css('position', 'absolute');
        frame.css('display', 'block');

        if (isview == true) {
            box.css('display', 'none');
            if (me.Attribute.Layout.Hide == true) { return; }
            let container_w = me.container.outerWidth();
            let container_h = me.container.outerHeight();
            let scroll_x = me.container.scrollLeft();
            let scroll_y = me.container.scrollTop();
            if (me.container.attr('id') == 'viewer') {
                container_w = me.container.parent().outerWidth();
                scroll_x = me.container.parent().scrollLeft();
                container_h = me.container.parent().outerHeight();
                scroll_y = me.container.parent().scrollTop();
            }
            let viewShade = $('<div></div>');
            me.container.append(viewShade);
            viewShade.append(frame);
            viewShade.append(title);

            if (me.Attribute.SchemeElementUiDrawer.Title == '') {
                title.css('display', 'none');
            }
            title.on('click', function (e) {
                e.stopPropagation();
            });

            viewShade.css('display', 'block');
            viewShade.css('background-color', 'rgba(0,0,0,' + (me.Attribute.SchemeElementUiDrawer.Transparency / 100) + ')');
            viewShade.css('position', 'absolute');
            viewShade.css('width', '100%');
            viewShade.css('height', '100%');
            viewShade.css('left', '0px');
            viewShade.css('top', '0px');
            viewShade.css('z-index', '99999');

            frame.css('background-color', '#fff');
            frame.on('click', function (e) {
                e.stopPropagation();
            });

            let frame_left = 0;
            let frame_top = 0;
            let frame_w = pos.W;
            let frame_h = pos.H;
            switch (me.Attribute.SchemeElementUiDrawer.Position) {
                case 'left-full':
                    frame_top = scroll_y + title_h;
                    frame_left = scroll_x;
                    frame_h = container_h;
                    break;
                case 'top-full':
                    frame_top = scroll_y + title_h;
                    frame_left = scroll_x;
                    frame_w = container_w;
                    break;
                case 'right-full':
                    frame_left = scroll_x + container_w - pos.W;
                    frame_top = scroll_y + title_h;
                    frame_h = container_h;
                    break;
                case 'bottom-full':
                    frame_w = container_w;
                    frame_h = pos.H - title_h;
                    frame_left = scroll_x;
                    frame_top = scroll_y + container_h - frame_h;
                    break;
            }
            showPanel(frame, title, frame_left, frame_top, frame_w, frame_h)

            viewShade.on('click', function () {
                hidePanel(viewShade, frame, title, frame_left, frame_top, frame_w, frame_h);
            });
            closeBtn.on('click', function (e) {
                hidePanel(viewShade, frame, title, frame_left, frame_top, frame_w, frame_h);
            });
        } else {
            box.append(frame);
            box.append(title);
            title.css('width', pos.W + 'px');

            let frame_h = pos.H - title_h;
            frame.css('width', '100%');
            frame.css('height', frame_h + 'px');
            frame.css('top', title_h + 'px');
            frame.css('background-color', '#fff');

            let frameShade = $('<div></div>');
            box.append(frameShade);
            frameShade.css('background-color', 'rgba(255,0,0,.01)');
            frameShade.css('position', 'absolute');
            frameShade.css('width', '100%');
            frameShade.css('height', '100%');
            frameShade.css('left', '0px');
            frameShade.css('top', '0px');
            frameShade.css('z-index', '999999');
        }
    };
    /**
     * 显示抽屉
     * @param {any} drawer
     * @param {any} title
     * @param {any} x
     * @param {any} y
     * @param {any} w
     * @param {any} h
     */
    let showPanel = function (drawer, title, x, y, w, h) {
        switch (me.Attribute.SchemeElementUiDrawer.Position) {
            case 'left-full':
                title.css('width', '0');
                title.css('height', title_h + 'px');
                title.css('top', y - title_h + 'px');
                title.css('left', x + 'px');
                drawer.css('width', '0px');
                drawer.css('height', h + 'px');
                drawer.css('top', y + 'px');
                drawer.css('left', x + 'px');

                title.animate({ width: w + 'px' });
                drawer.animate({ width: w + 'px' });
                break;
            case 'top-full':
                title.css('width', w + 'px');
                title.css('height', '0px');
                title.css('top', y - title_h + 'px');
                title.css('left', x + 'px');
                drawer.css('width', w + 'px');
                drawer.css('height', '0px');
                drawer.css('top', y - title_h + 'px');
                drawer.css('left', x + 'px');

                title.animate({ top: y - title_h + 'px', height: title_h + 'px' });
                drawer.animate({ top: y + 'px', height: h + 'px' });
                break;
            case 'right-full':
                title.css('width', '0');
                title.css('height', title_h + 'px');
                title.css('top', y - title_h + 'px');
                title.css('left', x + w + 'px');
                drawer.css('width', '0px');
                drawer.css('height', h + 'px');
                drawer.css('top', y + 'px');
                drawer.css('left', x + w + 'px');

                title.animate({ left: x + 'px', width: w + 'px' });
                drawer.animate({ left: x + 'px', width: w + 'px' });
                break;
            case 'bottom-full':
                title.css('width', w + 'px');
                title.css('height', '0px');
                title.css('top', y + title_h + h + 'px');
                title.css('left', x + 'px');
                drawer.css('width', w + 'px');
                drawer.css('height', '0px');
                drawer.css('top', y + title_h + h + 'px');
                drawer.css('left', x + 'px');

                title.animate({ top: y - title_h + 'px', height: title_h + 'px' });
                drawer.animate({ top: y + 'px', height: h + 'px' });
                break;

        }
    }
    /**
     * 隐藏抽屉
     * @param {any} shade
     * @param {any} drawer
     * @param {any} x
     * @param {any} y
     * @param {any} w
     * @param {any} h
     */
    let hidePanel = function (shade, drawer, title, x, y, w, h) {
        switch (me.Attribute.SchemeElementUiDrawer.Position) {
            case 'left-full':
                drawer.animate({ width: 0 }, function () {
                    shade.remove();
                });
                title.animate({ width: 0 }, function () {
                    shade.remove();
                });
                break;
            case 'top-full':
                drawer.animate({ top: y - title_h + 'px', height: 0 }, function () {
                    shade.remove();
                });
                title.animate({ height: 0 }, function () {
                    shade.remove();
                });
                break;
            case 'right-full':
                drawer.animate({ left: x + w + 'px', width: 0 }, function () {
                    shade.remove();
                });
                title.animate({ left: x + w + 'px', width: 0 }, function () {
                    shade.remove();
                });
                break;
            case 'bottom-full':
                drawer.animate({ top: y + h + 'px', height: 0 }, function () {
                    shade.remove();
                });
                title.animate({ top: y + h + 'px', height: 0 }, function () {
                    shade.remove();
                });
                break;

        }

    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(300);
        me.Attribute.SchemeElementUiDrawer = {
            Title: '我是标题',
            ShowTitle: true,
            PageId: '',
            ScrollBar: 'auto',
            Position: 'left-full',/* left top right bottom center */
            Time: 0,
            Transparency: 10
        };
        me.framePath = '';
        me.frameParentId = '';
        initMaskLayer();
    };
    me.loadChildClass = function (cfg) {
        me.framePath = '';
        me.frameParentId = '';
        initMaskLayer();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initMaskLayer();
    };
    me.refreshChildView = function () {
        me.framePath = '';
        me.frameParentId = '';
        me.refreshStyle();
        me.refreshViewFrame();
    };
};
SchemeElementUiDrawerComponent.prototype = Object.create(Element.prototype);
SchemeElementUiDrawerComponent.prototype.constructor = SchemeElementUiDrawerComponent;
