let SchemeFlatUiDropDownComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'FlatUi下拉菜单';
    selfconfig.elType = "SchemeFlatUiDropDown";
    selfconfig.src = 'scheme_flatui/dropdown';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let dropdown_box = $('<div></div>');
    let checked = false;

    let initDropDown = function () {
        me.setOverflow('visible');
        me.addElement(dropdown_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '1');
        } else {
        }
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮组样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        checked = false;
        dropdown_box.attr('class', 'componentstyle-schemeflatui-dropdown');
        dropdown_box.addClass('componentstyle-schemeflatui-dropdown-' + me.Attribute.SchemeFlatUiDropDown.Style);
        dropdown_box.html('');
        dropdown_box.css('height', pos.H + 'px');
        dropdown_box.css('line-height', pos.H + 'px');

        let btn = $('<span></span>');
        dropdown_box.append(btn);
        btn.css('line-height', pos.H + 'px');
        btn.append(me.Attribute.SchemeFlatUiDropDown.Text);
        let arrow = $('<i class="fa fa-caret-down"></i>');
        btn.append(arrow);
        btn.on('click', function () {
            checked = !checked;
            if (checked == true) {
                dropdown_box.addClass('checked');
            } else {
                dropdown_box.removeClass('checked');
            }
        });

        let ul = $('<ul></ul>');
        dropdown_box.append(ul);
        ul.css('top', pos.H + 'px');
        ul.css('min-width', pos.W + 'px');
        let items = me.Attribute.SchemeFlatUiDropDown.Items;
        $.each(items, function (n, v) {
            let li = $('<li></li>');
            ul.append(li);
            buildMenu(li, btn, v);
        });
    };
    /**
     * 创建菜单项
     * @param {any} li
     * @param {any} div
     * @param {any} item
     */
    let buildMenuItem = function (li, div, item) {
        let a = $('<a href="javascript:;"></a>');
        li.append(a);
        if (item.icon) {
            let icon = $('<em></em>');
            a.append(icon);
            let svg = $(item.icon);
            icon.append(svg);
        }

        a.append(item.text);

        a.on('click', function () {
            //open link
            checked = false;
            dropdown_box.removeClass('checked');
            if (div) {
                div.addClass('checked');
            }
            a.addClass('checked');
            me.framePath = '';
            me.frameParentId = '';
            me.pageLinkAction(item);
        });
    };
    /**
     * 创建菜单
     * @param {any} li
     * @param {any} div
     * @param {any} item
     */
    let buildMenu = function (li, div, item) {
        let items = item.children;
        if (items && items.length > 0) {
            let span = $('<span></span>');
            li.append(span);
            if (item.icon) {
                let icon = $('<em></em>');
                span.append(icon);
                let svg = $(item.icon);
                icon.append(svg);
            }
            span.append(item.text);
            let arrow = $('<i class="fa fa-caret-right"></i>');
            span.append(arrow);
            let ul = $('<ul></ul>');
            li.append(ul);
            $.each(items, function (n, v) {
                let li_child = $('<li></li>');
                ul.append(li_child);
                buildMenu(li_child, div, v);
            });
        } else {
            buildMenuItem(li, div, item);
        }
    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                text: v.text,
                target: v.attributes.target,
                pageid: v.attributes.pageid,
                icon: v.attributes.icon,
                group: v.attributes.group,
                checked: v.attributes.checked
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.text,
                attributes: {
                    target: v.target,
                    pageid: v.pageid,
                    icon: v.icon,
                    group: v.group,
                    checked: v.checked
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    /**
     * 加载元素链接的容器框架设置项
     * @param {any} editor
     * @param {any} frameid
     * @param {any} combo jquery-dom  $('#domid')
     */
    me.loadElementLinkTargetFrames = function (editor, frameid, combo) {
        let data = [];
        let frame_exist = false;
        $.each(editor.Frames, function (n, v) {
            let text = (v.name == '') ? '未命名' : v.name;
            if (frame_exist == false) {
                if (v.id == frameid) {
                    frame_exist = true;
                }
            }
            data.push({
                id: v.id,
                text: text
            });
        });
        combo.combobox('loadData', data);
        if (frame_exist == true) {
            combo.combobox('setValue', frameid);
        } else {
            combo.combobox('clear');
        }
    };


    me.initChildClass = function (cfg) {
        me.setLayoutW(210);
        me.setLayoutH(45);
        me.Attribute.SchemeFlatUiDropDown = {
            Text: 'DropDown Button',
            Style: 'dark',//light dark
            Items: [{
                text: 'Menu Item 1',
            }, {
                text: 'Menu Item 2',
                children: [{
                    text: 'Action 1'
                }, {
                    text: 'Action 2'
                }, {
                    text: 'Action 3'
                }]
            }, {
                text: 'Menu Item 3',
            }]
        };
        initDropDown();
    };
    me.loadChildClass = function (cfg) {
        initDropDown();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initDropDown();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
