let SchemeVantToastComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'vant轻提示';
    selfconfig.elType = "SchemeVantToast";
    selfconfig.src = 'scheme_vant/toast';
    selfconfig.iconCls = 'component-schemevant-toast';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let childrenTags = ['path', 'polygon', 'rect', 'circle', 'ellipse', 'line', 'polyline', 'text'];

    let toastBox = $('<div></div>');
    let toast = $("<div></div>");
    let icon = $('<div></div>');
    let txt = $('<span>提示信息</span>');
    me.image;

    let initToast = function () {
        let box = me.getBox();
        me.addElement(toastBox);
        toastBox.append(toast);
        toastBox.css('width', '100%');
        toastBox.css('height', '100%');
        toastBox.css('background-color', 'rgba(0,0,0,.01)');
        //toastBox.css('z-index', '9999');
        box.css('overflow', 'visible');
        if (isview == true) {
            box.css('z-index', 99999);
        }
        me.loadChildren();
        if (config.params) {
            //me.setLayoutW(config.params.width);
            //me.setLayoutH(config.params.height);
            me.Attribute.SchemeVantToast.Text = config.params.text;
            if (config.params.url.indexOf('xicon') == 0) {
                WidgetIcon.getXIconCodeFromUrl(config.params.url, function (image) {
                    me.Attribute.SchemeVantToast.SvgCode = image;
                    me.refreshStyle();
                });
            } else {
                WidgetIcon.getIconCodeFromUrl(config.params.url, function (image) {
                    me.Attribute.SchemeVantToast.SvgCode = image;
                    me.refreshStyle();
                });
            }
        } else {
            me.refreshStyle();
        }
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    }

    /**刷新样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let box = me.getBox();

        toast.html('');
        toast.append(icon);
        toast.append(txt);
        toast.css('display', 'block');
        toast.css('position', 'absolute');
        toast.css('width', pos.W + 'px');
        toast.css('height', pos.H + 'px');

        if (isview == true) {
            box.css('top', '0px');
            box.css('left', '0px');
            box.css('width', '100%');
            box.css('height', '100%');

            let w = box.outerWidth();
            let h = box.outerHeight();
            let scroll_x = $('#viewer').parent().scrollLeft();
            let scroll_y = $('#viewer').parent().scrollTop();

            if (box.parent().attr('id') == "viewer") {
                w = box.parent().parent().outerWidth();
                h = box.parent().parent().outerHeight();
            }
            toast.css('left', ((w - pos.W) / 2 + scroll_x) + 'px');
            switch (me.Attribute.SchemeVantToast.Position) {
                case 'top':
                    toast.css('top', (scroll_y + 10) + 'px');
                    break;
                case 'bottom':
                    toast.css('top', scroll_y + h - 138 + 'px');
                    break;
                default:
                    toast.css('top', (scroll_y + h - pos.H) / 2 + 'px');
                    break;
            }

        } else {
            toast.css('top', '0px');
            toast.css('left', '0px');
        }
        toast.css('border', 'solid 0 #555');
        toast.css('border-radius', '5px');
        toast.css('background-color', '#555');

        me.image = $(me.Attribute.SchemeVantToast.SvgCode);
        icon.html('');
        icon.append(me.image);
        icon.css('width', me.Attribute.SchemeVantToast.IconSize + 'px');
        icon.css('height', me.Attribute.SchemeVantToast.IconSize + 'px');
        icon.css('position', 'absolute');
        icon.css('left', (pos.W - me.Attribute.SchemeVantToast.IconSize) / 2 + 'px');
        icon.css('top', (pos.H - me.Attribute.SchemeVantToast.IconSize) / 3 + 'px');
        if (me.Attribute.SchemeVantToast.IsWhiteIcon == true) {
            $.each(childrenTags, function (n, v) {
                me.image.children(v).attr('fill', '#fff');
            });
        }

        txt.css('color', '#fff');
        txt.css('position', 'absolute');
        txt.css('width', '100%');
        txt.css('bottom', '0');
        txt.css('line-height', '54px');
        txt.css('font-size', '14px');
        txt.css('text-align', 'center');
        txt.text(me.Attribute.SchemeVantToast.Text);

        if (isview == true) {
            box.on('click', function (e) {
                box.css('display', 'none');
            });
            setTimeout(function () {
                box.css('display', 'none');
            }, me.Attribute.SchemeVantToast.Time * 1000);
        }
        //box.css('display', 'block');
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(128);
        me.setLayoutH(128);
        me.Attribute.SchemeVantToast = {
            SvgCode: '',
            Text: '提示信息',
            IsWhiteIcon: true,
            Position: 'center',
            IconSize: 48,
            Time: 2
        };
        //me.Attribute.Layout.Hide = true;
        initToast();
    };
    me.loadChildClass = function (cfg) {
        initToast();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initToast();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
