        monthBox.css('height', cell_h + 'px');
        monthBox.css('line-height', cell_h + 'px');
        monthBox.css('text-align', 'center');
        monthBox.css('cursor', 'default');
        monthBox.css('color', color);
        monthBox.css('font-size', me.Attribute.SchemeVantCalendarBox.Cell.FontSize + 'px');
        monthBox.text(year + '年' + month + '月');

        calendarTitle.append(preYearBtn);
        calendarTitle.append(preMonthBtn);
        calendarTitle.append(monthBox);
        calendarTitle.append(nextMonthBtn);
        calendarTitle.append(nextYearBtn);
        let weekData = ['日', '一', '二', '三', '四', '五', '六'];
