SchemeVantCheckCodeBoxComponent.prototype.constructor = SchemeVantCheckCodeBoxComponent;let SchemeVantScoreBoxComponent = function (container, config) {
    let me = this
    let selfconfig = config || {};
    selfconfig.TypeName = 'vant评分';
    selfconfig.elType = 'SchemeVantScoreBox';
    selfconfig.src = 'scheme_vant/scorebox';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;
    Element.call(this, container, selfconfig);

    //me.image;
    let isview = false;
    let childrenTags = ['path', 'polygon', 'rect', 'circle', 'ellipse', 'line', 'polyline', 'text'];
    let fullScore = 5;
    let shade = $('<div></div>');
    let selectedIndex = 4;

    me.loadImage = function () {
        initIcon();
    };
    let initIcon = function () {
        if (config.params && config.params.url) {
            WidgetIcon.getIconCodeFromUrl(config.params.url, function (image) {
                me.Attribute.SchemeVantScoreBox.SvgCode = image;
                me.refreshStyle();
                me.refreshIconEditViewStyle();
            });
        } else {
            me.refreshStyle();
        }
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };
    me.refreshChildrenTags = function (svgimg, attribute) {
        $.each(childrenTags, function (n, v) {
            svgimg.children(v).attr('stroke-width', attribute.SchemeVantScoreBox.Style.Stroke.Width + 'px');
            svgimg.children(v).attr('stroke', WidgetColor.ColorObjectToCssCode(attribute.SchemeVantScoreBox.Style.Stroke.Color));
            svgimg.children(v).attr('fill', WidgetColor.ColorObjectToCssCode(attribute.SchemeVantScoreBox.Style.Fill));

            let shadow = '';
            if (me.Attribute.SchemeVantScoreBox.Style.OuterShadowEnabled == true) {
                let c = WidgetColor.ColorObjectToCssCode(me.Attribute.SchemeVantScoreBox.Style.OuterShadowColor);

                shadow = ''
                    + parseInt(me.Attribute.SchemeVantScoreBox.Style.OuterShadowX) + 'px '
                    + parseInt(me.Attribute.SchemeVantScoreBox.Style.OuterShadowY) + 'px '
                    + parseInt(me.Attribute.SchemeVantScoreBox.Style.OuterShadowBlur) + 'px '
                    + c;

                svgimg.children(v).css('filter', 'drop-shadow(' + shadow + ')');
            }
        });
    };
    /**
     * 不选择
     * @param {any} svgimg
     */
    let unSelect = function (svgimg) {
        $.each(childrenTags, function (n, v) {
            svgimg.children(v).attr('stroke', '#ccc');
            svgimg.children(v).attr('fill', '#ccc');

            let shadow = '';
            if (me.Attribute.SchemeVantScoreBox.Style.OuterShadowEnabled == true) {
                let c = '#bbb';

                shadow = ''
                    + parseInt(me.Attribute.SchemeVantScoreBox.Style.OuterShadowX) + 'px '
                    + parseInt(me.Attribute.SchemeVantScoreBox.Style.OuterShadowY) + 'px '
                    + parseInt(me.Attribute.SchemeVantScoreBox.Style.OuterShadowBlur) + 'px '
                    + c;

                svgimg.children(v).css('filter', 'drop-shadow(' + shadow + ')');
            }
        });
    };
    /** 刷新属性编辑区预览样式 */
    me.refreshIconEditViewStyle = function () {
        let svg = $(me.Attribute.SchemeVantScoreBox.SvgCode);
        let svgView = $('#attr_schemeVantScoreBoxSvgViewBox');
        svgView.html('');
        svgView.append(svg);
        me.refreshChildrenTags(svg, me.Attribute);
    };
    /**
     * 刷新交互-元素变换中的属性编辑区的预览样式
     * @param {any} svgView
     * @param {any} attribute
     */
    me.refreshIconViewStyle = function (svgView, attribute) {
        let svg = $(attribute.SchemeVantScoreBox.SvgCode);
        svgView.html('');
        svgView.append(svg);
        me.refreshChildrenTags(svg, attribute);
    }
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let box = me.getBox();
        box.html('');
        for (let i = 0; i < fullScore; i++) {
            let image = $(me.Attribute.SchemeVantScoreBox.SvgCode);
            image.css('overflow', 'visible');
            let image_box = $('<div></div>');
            image_box.append(image);
            box.append(image_box);
            image_box.addClass('vant-scorebox-' + me.id);
            image_box.attr('vant-scorebox-order', i);
            image_box.css('cursor', 'pointer');
            image_box.css('display', 'block');
            image_box.css('position', 'absolute');
            image_box.css('width', me.Attribute.SchemeVantScoreBox.Style.Size + 'px');
            image_box.css('height', me.Attribute.SchemeVantScoreBox.Style.Size + 'px');
            let left = (me.Attribute.SchemeVantScoreBox.Style.Size + me.Attribute.SchemeVantScoreBox.Style.Space) * i;
            let top = (pos.H - me.Attribute.SchemeVantScoreBox.Style.Size) / 2;
            if (top < 0) { top = 0; }
            image_box.css('top', top + 'px');
            image_box.css('left', left + 'px');
            if (i < me.Attribute.SchemeVantScoreBox.Score) {
                me.refreshChildrenTags(image, me.Attribute);
            } else {
                unSelect(image);
            }

            image_box.on('click', function () {
                let items = $('.vant-scorebox-' + me.id);
                $.each(items, function (n, v) {
                    selectedIndex = i;
                    let item = $(v.children[0]);
                    if (n <= i) {
                        me.refreshChildrenTags(item, me.Attribute);
                    } else {
                        unSelect(item);
                    }
                });
            });
        }

        if (isview == false) {
            box.append(shade);
            shade.css('display', 'block');
            shade.css('position', 'absolute');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('top', '0');
            shade.css('left', '0');
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(110);
        me.setLayoutH(32);
        me.Attribute.SchemeVantScoreBox = {
            SvgCode: '',
            Score: 4,
            Style: {
                Size: 20,
                Space: 1,
                Fill: { ColorR: 255, ColorG: 210, ColorB: 30, A: 1 },
                Stroke: { Width: 0, Color: { ColorR: 0, ColorG: 0, ColorB: 0, A: 1 } },
                OuterShadowEnabled: false,
                OuterShadowX: 2,
                OuterShadowY: 2,
                OuterShadowBlur: 2,
                OuterShadowColor: { ColorR: 0, ColorG: 0, ColorB: 0, A: 1 }
            }
        };
        initIcon();
    };
    me.loadChildClass = function (cfg) {
        initIcon();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initIcon();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
