let SchemeVantSliderComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'vant滑块';
    selfconfig.elType = 'SchemeVantSlider';
    selfconfig.src = 'scheme_vant/slider';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;
    Element.call(this, container, selfconfig);

    let isview = false;
    let btnRadius = 24;
    let lineWidth = 2;
    let sliderBox = $('<div></div>');
    let bar = $('<div></div>');
    let btn = $('<div></div>');

    let initSlider = function () {
        me.addElement(sliderBox);
        me.loadChildren();
        me.setOverflow('visible');
        sliderBox.css('width', '100%');
        sliderBox.append(bar);
        sliderBox.append(btn);


        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    }
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let color = WidgetColor.ColorObjectToCssCode(me.Attribute.SchemeVantSlider.Color);
        let btnX = parseInt(pos.W * me.Attribute.SchemeVantSlider.Position / 100);
        sliderBox.css('position', 'absolute');
        //sliderBox.css('border', 'solid 1px ' + color);
        sliderBox.css('background-color', '#ddd');
        sliderBox.css('height', lineWidth + 'px');
        sliderBox.css('top', (pos.H / 2 - lineWidth / 2) + 'px');
        sliderBox.css('border-radius', '16px');

        btn.css('position', 'absolute');
        btn.css('width', btnRadius + 'px');
        btn.css('height', btnRadius + 'px');
        //btn.css('border-style', 'solid');
        //btn.css('border-width', '1px');
        //btn.css('border-color', color);
        btn.css('background-color', '#fff');
        btn.css('border-radius', btnRadius + 'px');
        btn.css('top', lineWidth / 2 - btnRadius / 2 + 'px');
        btn.css('left', btnX - (btnRadius / 2) + 'px');
        btn.css('box-shadow', '1px 1px 1px 1px rgba(0,0,0,.5)');


        bar.css('position', 'absolute');
        bar.css('backgroundColor', color);
        bar.css('border-radius', '16px');
        bar.css('width', btnX + 'px');
        bar.css('height', lineWidth + 'px');

        if (isview == true) {
            btn.unbind();
            btn.on('mousedown', function (e) {
                let startX = e.clientX;
                let btnStartX = btn.position().left;
                $(document).on('mousemove', function (e_mov) {
                    e_mov.preventDefault();
                    e_mov.stopPropagation();
                    let dx = e_mov.clientX - startX;
                    let movX = btnStartX + dx;
                    if (movX < 0) { movX = 0; }
                    else if (movX > pos.W) {
                        movX = pos.W
                    }
                    btn.css('left', movX + 'px');
                    bar.css('width', movX + 'px');
                });
                $(document).on('mouseup', function () {
                    $(document).unbind();
                })
            });
        }

    };
    me.initChildClass = function () {
        me.setLayoutW(260);
        me.setLayoutH(48);
        me.Attribute.SchemeVantSlider = {
            Position: 50,
            Color: { ColorR: 25, ColorG: 137, ColorB: 250, A: 1 }
        };
        initSlider();
    };
    me.loadChildClass = function () {
        initSlider();
    };
    me.viewChildClass = function () {
        isview = true;
        initSlider();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
