        input.css('font-family', me.Attribute.SchemeVantTextArea.Input.FontFamily);
        input.val(me.Attribute.SchemeVantTextArea.Input.Text);
        if (me.Attribute.SchemeVantTextArea.Disabled == true) {
            label.css('color', '#ccc');
            label.css('cursor', 'not-allowed');
            input.css('cursor', 'not-allowed');
        }
        else {

        }
        input.attr('disabled', me.Attribute.SchemeVantTextArea.Disabled);
        let txtCal = function () {
            let max = me.Attribute.SchemeVantTextArea.Input.MaxLength;
            let txt = input.val();
            let len = txt.length;
            if (len > max) {
                input.val(txt.substring(0, max));
            }
            inputCount.text(len + '/' + max);
        };
        txtCal();
        input.on('keyup', function () {
            txtCal();
        });

