        inputCount.css('display', 'block');
        inputCount.css('bottom', '0px');
        inputCount.css('right', '0px');
        inputCount.css('height', inputCount_h + 'px');
        inputCount.css('line-height', inputCount_h + 'px');
        inputCount.text('0/50');
