        //title.append(closeBtn);
        btn.css('position', 'absolute');
        btn.css('height', btn_h + 'px');
        btn.css('line-height', btn_h + 'px');
        btn.css('font-size', '14px');
        btn.css('cursor', 'pointer');
        //btn.css('border-left', 'solid 1px #ccc');
        btn.css('text-align', 'center');
        btn.css('top', '0');
        btn.css('color', WidgetColor.ColorObjectToCssCode(me.Attribute.SchemeVantInfoWindow.Button.TextColor));
