            frameShade.css('background-color', 'rgba(255,255,255,0.001)');
            frameShade.css('position', 'absolute');
            frameShade.css('width', '100%');
            frameShade.css('height', '100%');
            frameShade.css('left', '0px');
            frameShade.css('top', '0px');
            frameShade.css('z-index', '999999');
