let SchemeVantSwipeComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'vant轮播图-水平';
    selfconfig.elType = "SchemeVantSwipe";
    selfconfig.src = 'scheme_vant/swipe';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;

    let swipeBox = $('<div></div>');

    let initSwipe = function () {
        me.addElement(swipeBox);
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    }
    let cur_index = 0;
    let runHandler;
    /**刷新样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        swipeBox.html('');
        let btnbox = $('<div></div>');
        let btnColor = WidgetColor.ColorObjectToCssCode(me.Attribute.SchemeVantSwipe.BtnColor);
        let items_count = me.Attribute.SchemeVantSwipe.Items.length;
        let m = 0;
        let btn_space = 10;//按钮间空隙
        let btn_d = 6;//按钮直径
        let btn_first_left = 0;//第一个按钮左边距
        if (items_count % 2 == 1) {
            //奇数
            m = (items_count - 1) / 2;
            btn_first_left = m * (btn_space + btn_d) + btn_d;
        }
        else {
            //偶数
            m = items_count / 2;
            btn_first_left = m * (btn_space + btn_d);
        }
        $.each(me.Attribute.SchemeVantSwipe.Items, function (n, v) {
            let btn = $('<div></div>');
            let imgbox = $('<div class="img"></div>');
            swipeBox.append(imgbox);
            //imgbox.attr('class', 'img-' + n);
            imgbox.css('position', 'absolute');
            imgbox.css('background-color', WidgetColor.ColorObjectToCssCode(v.BgColor));
            imgbox.css('text-align', 'center');
            imgbox.css('width', pos.W + 'px');
            imgbox.css('height', pos.H + 'px');
            imgbox.css('line-height', pos.H + 'px');
            imgbox.css('top', '0px');
            imgbox.css('left', pos.W * n + 'px');
            imgbox.css('color', '#fff');
            if (v.Image) {
                imgbox.css('background-image', 'url(' + v.Image + ')');
                imgbox.text('');
            } else {
                imgbox.css('background-image', 'unset');
                imgbox.text(v.Text);
            }

            btnbox.append(btn);
            btn.css('position', 'absolute');
            btn.css('width', '6px');
            btn.css('height', '6px');
            btn.css('border-radius', '50%');
            if (cur_index == n) {
                btn.css('background-color', btnColor);
            } else {
                btn.css('background-color', 'rgba(221,221,221,.7)');
            }
            btn.css('left', (btn_d + btn_space) * n + 'px');
            btn.css('cursor', 'pointer');
        });
        swipeBox.append(btnbox);
        btnbox.css('position', 'absolute');
        btnbox.css('display', 'block');
        btnbox.css('width', btn_first_left * 2 + 'px');
        btnbox.css('height', '6px');
        btnbox.css('left', (pos.W / 2 - btn_first_left) + 'px');
        btnbox.css('bottom', '20px');

        let swiperun = function () {
            let children = swipeBox.children('.img');
            let cur_start = 0;
            let cur_stop = (0 - pos.W);
            $(children[cur_index]).css('left', cur_start + 'px');
            $(children[cur_index]).animate({ left: cur_stop + 'px' }, 1000);
            let next_index = cur_index + 1;
            if (next_index > children.length - 1) {
                next_index = 0;
            }

            let next_start = pos.W;
            let next_stop = 0;
            $(children[next_index]).css('left', next_start + 'px');
            $(children[next_index]).animate({ left: next_stop + 'px' }, 1000, function () {
                if (runHandler) {
                    clearTimeout(runHandler);
                }
                let btns = btnbox.children();
                $.each(btns, function (k, v) {
                    if (k == cur_index) {
                        $(v).css('background-color', btnColor);
                    } else {
                        $(v).css('background-color', 'rgba(221,221,221,.7)');
                    }
                });
                runHandler = setTimeout(swiperun, 1000);
            });

            cur_index++;
            if (cur_index >= children.length) {
                cur_index = 0;
            }
        };
        if (runHandler) {
            clearTimeout(runHandler);
        }
        runHandler = setTimeout(function () {
            swiperun();
        }, 1000);
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(120);
        me.Attribute.SchemeVantSwipe = {
            BtnColor: { ColorR: 57, ColorG: 169, ColorB: 237, A: 1 },
            Items: [{
                Text: '1',
                BgColor: { ColorR: 95, ColorG: 158, ColorB: 160, A: 1 },
                Image: null
            }, {
                Text: '2',
                BgColor: { ColorR: 233, ColorG: 150, ColorB: 120, A: 1 },
                Image: null
            }, {
                Text: '3',
                BgColor: { ColorR: 176, ColorG: 196, ColorB: 222, A: 1 },
                Image: null
            }]
        };
        initSwipe();
    };
    me.loadChildClass = function (cfg) {
        initSwipe();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initSwipe();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
