let SchemeVantSideBarComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'Vant侧边导航';
    selfconfig.elType = "SchemeVantSideBar";
    selfconfig.src = 'scheme_vant/sidebar';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let sidebar_box = $("<div></div>");

    let initSideBar = function () {
        me.addElement(sidebar_box);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', '999');
        }
        me.loadChildren();
        if (config.params) {
            me.Attribute.SchemeVantSideBar.Style = config.params.style;
        }
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新选项样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        sidebar_box.html('');
        sidebar_box.attr('class', 'componentstyle-schemevant-sidebar');
        let items_count = me.Attribute.SchemeVantSideBar.Items.length;
        let label_w = pos.W / items_count + items_count - 1;
        label_w = (pos.W + (items_count / 2)) / items_count;
        $.each(me.Attribute.SchemeVantSideBar.Items, function (n, v) {
            let label = $('<label></label>');
            sidebar_box.append(label);

            let input = $('<input/>');
            input.attr('type', 'radio');
            input.attr('name', 'radio' + me.id);
            label.append(input);
            if (v.Checked == true) {
                input.attr('checked', 'checked');
            } else {
                input.removeAttr('checked');
            }
            if (v.Disabled == true) {
                input.attr('disabled', true);
            } else {
                input.removeAttr('disabled');
            }

            let text_cell = $('<span></span>');
            label.append(text_cell);

            let txt = $('<span></span>');
            text_cell.append(txt);
            txt.text(v.Text);

            if (v.Badge != '') {
                let badge = $('<em></em>');
                txt.append(badge);
                badge.text(v.Badge);
                badge.css('background-color', WidgetColor.ColorObjectToCssCode(v.BadgeColor));
            }

            let tagLine = $('<span></span>');
            label.append(tagLine);
            tagLine.css('background-color', WidgetColor.ColorObjectToCssCode(me.Attribute.SchemeVantSideBar.SelectedColor));

            input.unbind('click');
            input.on('click', function () {
                me.framePath = '';
                me.frameParentId = '';
                let action = {
                    pageid: v.pageid,
                    target: v.target
                };
                me.pageLinkAction(action);
            });
        });

    };

    /**
     * 将树的数据转换为菜单数据
     * @param {any} parentChildren
     * @param {any} data
     */
    me.convertTreeDataToData = function (parentChildren, data) {
        $.each(data, function (n, v) {
            let d = {
                Text: v.text,
                Checked: v.attributes.Checked,
                Disabled: v.attributes.Disabled,
                Badge: v.attributes.Badge,
                BadgeColor: v.attributes.BadgeColor,
                target: v.attributes.target,
                pageid: v.attributes.pageid
            };
            if (v.children) {
                d.children = [];
                me.convertTreeDataToData(d.children, v.children);
            }
            parentChildren.push(d);
        });
    };
    /**
     * 将菜单数据转换为树的数据
     * @param {any} treeNodeData
     * @param {any} data
     */
    me.convertDataToTreeData = function (treeNodeData, data) {
        $.each(data, function (n, v) {
            let d = {
                iconCls: 'atomicon-file',
                text: v.Text,
                attributes: {
                    Checked: v.Checked,
                    Disabled: v.Disabled,
                    Badge: v.Badge,
                    BadgeColor: v.BadgeColor,
                    target: v.target,
                    pageid: v.pageid
                }
            };
            if (v.children) {
                d.children = [];
                me.convertDataToTreeData(d.children, v.children);
            }
            treeNodeData.push(d);
        });
    };

    /**
     * 加载元素链接的容器框架设置项
     * @param {any} editor
     * @param {any} frameid
     * @param {any} combo jquery-dom  $('#domid')
     */
    me.loadElementLinkTargetFrames = function (editor, frameid, combo) {
        let data = [];
        let frame_exist = false;
        $.each(editor.Frames, function (n, v) {
            let text = (v.name == '') ? '未命名' : v.name;
            if (frame_exist == false) {
                if (v.id == frameid) {
                    frame_exist = true;
                }
            }
            data.push({
                id: v.id,
                text: text
            });
        });
        combo.combobox('loadData', data);
        if (frame_exist == true) {
            combo.combobox('setValue', frameid);
        } else {
            combo.combobox('clear');
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(80);
        me.setLayoutH(400);
        me.Attribute.SchemeVantSideBar = {
            Style: 'primary',
            SelectedColor: { ColorR: 255, ColorG: 20, ColorB: 0, A: 1 },
            Items: [{
                Text: '标签一',
                Badge: '5',
                BadgeColor: { ColorR: 255, ColorG: 0, ColorB: 0, A: 1 },
                Checked: true,
                Disabled: false
            }, {
                Text: '标签二',
                Badge: '',
                BadgeColor: { ColorR: 255, ColorG: 0, ColorB: 0, A: 1 },
                Checked: false,
                Disabled: false
            }, {
                Text: '标签三',
                Badge: '',
                BadgeColor: { ColorR: 255, ColorG: 0, ColorB: 0, A: 1 },
                Checked: false,
                Disabled: false
            }]
        };
        initSideBar();
    };
    me.loadChildClass = function (cfg) {
        initSideBar();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initSideBar();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
