    let getText = function () {
        let items = me.Attribute.SchemeVantPicker.Items;
        let txt = '';
        if (items.length > 0) {
            txt = getNextText(items[0]);
        }
        return txt;
    };
    let getNextText = function (item) {
        let txt = item.text;
        if (item.children && item.children.length > 0) {
            txt += '/' + getNextText(item.children[0]);
        }
        return txt;
    };
    /**
     * 获取指定区域对应的级别索引
     * @param {any} x
     * @param {any} w
     */
    let getLevelIndex = function (x, w) {
        let level = me.Attribute.SchemeVantPicker.Level;
        let item_w = w / level;
        for (let i = 0; i < level; i++) {
            if ((x > i * item_w) && (x <= i * item_w + item_w)) {
                return i;
            }
        }
        return -1;
    }
    /**
     * 设置选中项位置
     * @param {any} level_i 列表登记
     * @param {any} y 列表位置
     */
    let setSelectedPosition = function (level_i, y) {
        let div = list_box[level_i];
        div.css('top', y + 'px');
    };
    /**
     * 设置选中选项
     * @param {any} level_i
     * @param {any} y
     * @param {any} items
     */
    let setSelected = function (level_i, y, items) {
        setSelectedPosition(level_i, y);
        let i = level_i + 1;
        if (i < me.Attribute.SchemeVantPicker.Level) {
            clearChildHtml(i);
            //selected_data.splice(i);
            if (items) {
                $.each(items, function (n, v) {
                    let li = $('<li></li>');
                    list_box[i].append(li);
                    li.text(v.text);
                    li.attr('items', JSON.stringify(v.children));
                    li.css('line-height', '44px');
                    li.css('text-align', 'center');
                    if (n == 0) {
                        setSelected(i, 108, v.children);
                    }
                });
            }
        }
    };
    /**
     * 清理指定级别的选项
     * @param {any} level_i
     */
    let clearChildHtml = function (level_i) {
        if (level_i < me.Attribute.SchemeVantPicker.Level) {
            list_box[level_i].html('');
            clearChildHtml(level_i + 1);
        }
    };

    /**
     * 设置对应级别的选项位置
     * @param {any} level_i
     * @param {any} top
     */
    let getSelectedItem = function (level_i, top) {
        let top_tmp = top;
        let top_selected;
        let index_selected;
        let li_items = list_box[level_i].children('li');

        let line_top = 108;
        let li_h = 44;
        let ul_h = li_h * li_items.length;
        let min_top = line_top - (li_items.length - 1) * li_h;
        let max_top = line_top;

        if (top_tmp < min_top) { top_tmp = min_top; }
        if (top_tmp > max_top) { top_tmp = max_top; }


        let s = parseInt((max_top - top_tmp) / li_h);//商
        let m = (max_top - top_tmp) % li_h;//余数
        if (m < li_h / 2) {
            index_selected = s;
        } else {
            index_selected = Math.min(s + 1, li_items.length - 1);
            if (index_selected < 0) { index_selected = 0; }
        }
        top_selected = line_top - li_h * index_selected;
        if (s == 0) {
            top_selected = Math.max(top_selected, min_top);
        } else if (s == li_items.length - 1) {
            top_selected = Math.max(top_selected, max_top);
        }
        let items_str = $(li_items[index_selected]).attr('items');
        let children_items;
        if (items_str) {
            children_items = JSON.parse(items_str);
        }
        return {
            top: top_selected,
            index: index_selected,
            items: children_items
        };
    };
    /**
     * 显示选项面板
     * @param {any} panel
     * @param {any} x
     * @param {any} y
     * @param {any} w
     * @param {any} h
     */
    let showSelectPanel = function (panel, x, y, w, h) {
        panel.css('width', w + 'px');
        panel.css('height', '0px');
        panel.css('top', y + h + 'px');
        panel.css('left', x + 'px');

        panel.animate({ top: y + 'px', height: h + 'px' });
    };
    /**
     * 隐藏选项面板
     * @param {any} shade
     * @param {any} panel
     * @param {any} x
     * @param {any} y
     * @param {any} w
     * @param {any} h
     */
    let hideSelectPanel = function (shade, panel, x, y, w, h) {
        panel.animate({ top: y + h + 'px', height: 0 }, function () {
            shade.remove();
        });
    };
    /**
     * 讲数据转换为系统树菜单结构
     * @param {any} items
     */
    me.getItemsFromTree = function (items) {
        let data = [];
        $.each(items, function (n, v) {
            let item = {
                text: v.text,
                iconCls: 'atomicon-file'
            };
            if (v.children) {
                item.children = me.getItemsFromTree(v.children);
            }
            data.push(item);
        });
        return data;
    };

