            collapse_box.attr('id', collapse_box_id);
            collapse_box.attr('aria-labelledby', collapse_header_id);
            collapse_box.attr('data-parent', '#' + accordin_id);
            if (n == 0) {
                collapse_box.addClass('show');
            }

            let card_body = $('<div class="card-body">');
