let SchemeBootstrapPagingComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'Bootstrap分页';
    selfconfig.elType = "SchemeBootstrapPaging";
    selfconfig.src = 'scheme_bootstrap/paging';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let ul_pager = $('<ul class="pagination"></ul>');

    let initPager = function () {
        me.addElement(ul_pager);
        ul_pager.attr('id', 'schemebootstrap_paging_' + me.id);
        me.loadChildren();
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', 99);
        }
        me.setOverflow('visible');
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        ul_pager.html('');
        ul_pager.css('width', '100%');
        ul_pager.css('height', pos.H + 'px');
        ul_pager.css('padding', (pos.H - 35) / 2 + 'px 0');
        let li_first = $('<li class="page-item first-page"></li>');
        let li_last = $('<li class="page-item last-page"></li>');
        let li_pre = $('<li class="page-item pre-page"></li>');
        let li_next = $('<li class="page-item next-page"></li>');
        if (me.Attribute.SchemeBootstrapPaging.ShowFirstLast == true) {
            ul_pager.append(li_first);
            let a_first = $('<a class="page-link" href="#">首页</a>');
            li_first.append(a_first);
            if (me.Attribute.SchemeBootstrapPaging.Symbol == true) {
                a_first.html('&laquo;');
            }
            li_first.on('click', function () {
                me.Attribute.SchemeBootstrapPaging.CurrentPage = 1;
                refreshPageStatus();
            });
        }
        if (me.Attribute.SchemeBootstrapPaging.ShowPreNext == true) {
            ul_pager.append(li_pre);
            let a_pre = $('<a class="page-link" href="#">上一页</a>');
            li_pre.append(a_pre);
            if (me.Attribute.SchemeBootstrapPaging.Symbol == true) {
                a_pre.html('&lsaquo;');
            }
            li_pre.on('click', function () {
                me.Attribute.SchemeBootstrapPaging.CurrentPage -= 1;
                refreshPageStatus();
            });
        }

        for (let i = 0; i < me.Attribute.SchemeBootstrapPaging.Total; i++) {
            let li = $('<li class="page-item"></li>');
            ul_pager.append(li);
            li.addClass('page_' + (i + 1));
            let a = $('<a class="page-link" href="#"></a>');
            li.append(a);
            a.text(i + 1);
            li.on('click', function () {
                me.Attribute.SchemeBootstrapPaging.CurrentPage = i + 1;
                refreshPageStatus();
            });
        }

        if (me.Attribute.SchemeBootstrapPaging.ShowPreNext == true) {
            ul_pager.append(li_next);
            let a_next = $('<a class="page-link" href="#">下一页</a>');
            li_next.append(a_next);
            if (me.Attribute.SchemeBootstrapPaging.Symbol == true) {
                a_next.html('&rsaquo;');
            }
            li_next.on('click', function () {
                me.Attribute.SchemeBootstrapPaging.CurrentPage += 1;
                refreshPageStatus();
            });
        }
        if (me.Attribute.SchemeBootstrapPaging.ShowFirstLast == true) {
            ul_pager.append(li_last);
            let a_last = $('<a class="page-link" href="#">尾页</a>');
            li_last.append(a_last);
            if (me.Attribute.SchemeBootstrapPaging.Symbol == true) {
                a_last.html('&raquo;');
            }
            li_last.on('click', function () {
                me.Attribute.SchemeBootstrapPaging.CurrentPage = me.Attribute.SchemeBootstrapPaging.Total;
                refreshPageStatus();
            });
        }
        refreshPageStatus();
    };

    let refreshPageStatus = function () {
        let pageno = parseInt(me.Attribute.SchemeBootstrapPaging.CurrentPage);
        let total = parseInt(me.Attribute.SchemeBootstrapPaging.Total);
        //越界保护
        if (pageno < 1) { me.Attribute.SchemeBootstrapPaging.CurrentPage = 1; }
        if (pageno > total) {
            me.Attribute.SchemeBootstrapPaging.CurrentPage = total;
        }

        $('#schemebootstrap_paging_' + me.id + ' li').removeClass('active');
        if (me.Attribute.SchemeBootstrapPaging.CurrentPage == 1) {
            //首页
            $('#schemebootstrap_paging_' + me.id + ' .first-page').addClass('disabled');
            $('#schemebootstrap_paging_' + me.id + ' .pre-page').addClass('disabled');
        } else {
            $('#schemebootstrap_paging_' + me.id + ' .first-page').removeClass('disabled');
            $('#schemebootstrap_paging_' + me.id + ' .pre-page').removeClass('disabled');
        }
        if (me.Attribute.SchemeBootstrapPaging.CurrentPage == me.Attribute.SchemeBootstrapPaging.Total) {
            //尾页
            $('#schemebootstrap_paging_' + me.id + ' .last-page').addClass('disabled');
            $('#schemebootstrap_paging_' + me.id + ' .next-page').addClass('disabled');
        } else {
            $('#schemebootstrap_paging_' + me.id + ' .last-page').removeClass('disabled');
            $('#schemebootstrap_paging_' + me.id + ' .next-page').removeClass('disabled');
        }
        $('#schemebootstrap_paging_' + me.id + ' .page_' + me.Attribute.SchemeBootstrapPaging.CurrentPage).addClass('active');

    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(220);
        me.setLayoutH(38);
        me.Attribute.SchemeBootstrapPaging = {
            Total: 3,
            CurrentPage: 1,
            Symbol: true,
            ShowPreNext: true,
            ShowFirstLast: true
        };
        initPager();
    };
    me.loadChildClass = function (cfg) {
        initPager();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initPager();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
