let SchemeBootstrapProgressComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'Bootstrap进度条';
    selfconfig.elType = "SchemeBootstrapProgress";
    selfconfig.src = 'scheme_bootstrap/progress';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;
    let progress_box = $('<div class="progress"></div>');
    let progress = $('<div class="progress-bar" role="progressbar" aria-valuemin="0" aria-valuemax="100"></div>');

    let initProgress = function () {
        me.addElement(progress_box);
        progress_box.append(progress);
        if (isview == false) {
            let shade = $('<div></div>');
            me.addElement(shade);
            shade.css('position', 'absolute');
            shade.css('left', '0');
            shade.css('top', '0');
            shade.css('background-color', 'rgba(255,255,255,0.001)');
            shade.css('width', '100%');
            shade.css('height', '100%');
            shade.css('z-index', 99);
        }
        me.setOverflow('visible');
        me.loadChildren();
        if (config.params) {
            me.Attribute.SchemeBootstrapProgress.Style = config.params.style;
        }
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新按钮样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        progress_box.css('height', pos.H + 'px');

        progress.attr('class', 'progress-bar');
        progress.attr('aria-valuemin', '0');
        progress.attr('aria-valuemax', '100');
        progress.css('width', '0%');

        if (me.Attribute.SchemeBootstrapProgress.Striped == true) {
            progress.addClass('progress-bar-striped');//条纹
        }
        if (me.Attribute.SchemeBootstrapProgress.StripedAnimation == true) {
            progress.addClass('progress-bar-animated');//动态条纹
        }
        progress.addClass('bg-' + me.Attribute.SchemeBootstrapProgress.Style);

        progress.text('');
        if (isview == true) {
            if (me.Attribute.SchemeBootstrapProgress.Animation.Enabled == true) {
                barLength = parseInt(me.Attribute.SchemeBootstrapProgress.Animation.Start);
                progress.css('width', me.Attribute.SchemeBootstrapProgress.Animation.Start + '%');
                setTimeout(function () {
                    setBarLength(1);
                }, 50);
            } else {
                progress.css('width', me.Attribute.SchemeBootstrapProgress.Value + '%');
                if (me.Attribute.SchemeBootstrapProgress.TextEnabled == true) {
                    progress.text(me.Attribute.SchemeBootstrapProgress.Value + '%');
                }
            }
        } else {
            progress.css('width', me.Attribute.SchemeBootstrapProgress.Value + '%');
            if (me.Attribute.SchemeBootstrapProgress.TextEnabled == true) {
                progress.text(me.Attribute.SchemeBootstrapProgress.Value + '%');
            }
        }
    };
    /**进度值 */
    let barLength = 0;
    /**
     * 设置进度条进度值
     * @param {any} v
     */
    let setBarLength = function (v) {
        barLength += parseInt(v);
        let stopV = parseInt(me.Attribute.SchemeBootstrapProgress.Value);
        if (barLength > stopV) {
            barLength = stopV;
        }

        progress.css('width', barLength + '%');
        if (me.Attribute.SchemeBootstrapProgress.TextEnabled == true) {
            progress.text(barLength + '%');
        }
        if (barLength < stopV) {
            setTimeout(function () { setBarLength(v); }, 50);
        }

    }

    me.initChildClass = function (cfg) {
        me.setLayoutW(260);
        me.setLayoutH(16);
        me.Attribute.SchemeBootstrapProgress = {
            TextEnabled: true,//: '按钮',
            Value: 75,
            Animation: {
                Enabled: true,
                Start: 0
            },
            Striped: true,
            StripedAnimation: true,
            Style: 'primary'
        };
        initProgress();
    };
    me.loadChildClass = function (cfg) {
        initProgress();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initProgress();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
