let SchemeBootstrapLoadingComponent = function (container, config) {
    let me = this;
    let selfconfig = config || {};
    selfconfig.TypeName = 'Bootstrap加载';
    selfconfig.elType = "SchemeBootstrapLoading";
    selfconfig.src = 'scheme_bootstrap/loading';
    selfconfig.AttributeBorderDisabled = true;
    selfconfig.AttributeBackgroundDisabled = true;

    Element.call(this, container, selfconfig);

    let isview = false;

    let initLoading = function () {
        me.loadChildren();
        me.refreshStyle();
    };
    me.setChildrenSize = function (pos) {
        me.refreshStyle();
    };

    /**刷新样式 */
    me.refreshStyle = function () {
        let pos = me.getLocation();
        let box = me.getBox();
        box.html('');
        let loading_box = $('<div role="status"></div>');

        loading_box.attr('class', 'spinner-' + me.Attribute.SchemeBootstrapLoading.IconStyle);
        loading_box.addClass('text-' + me.Attribute.SchemeBootstrapLoading.Style);
        loading_box.css('position', 'absolute');
        loading_box.css('width', '32px');
        loading_box.css('height', '32px');
        if (isview == true) {

            box.css('display', 'none');
            if (me.Attribute.Layout.Hide == true) { return; }
            let container_w = me.container.outerWidth();
            let container_h = me.container.outerHeight();
            let scroll_x = me.container.scrollLeft();
            let scroll_y = me.container.scrollTop();
            if (me.container.attr('id') == 'viewer') {
                container_w = me.container.parent().outerWidth();
                scroll_x = me.container.parent().scrollLeft();
                container_h = me.container.parent().outerHeight();
                scroll_y = me.container.parent().scrollTop();
            }
            let viewShade = $('<div class="viewShade"></div>');
            me.container.append(viewShade);
            viewShade.append(loading_box);

            viewShade.css('display', 'block');
            viewShade.css('background-color', 'rgba(255,255,255,.01)');
            viewShade.css('position', 'absolute');
            viewShade.css('width', '100%');
            viewShade.css('height', '100%');
            viewShade.css('left', '0px');
            viewShade.css('top', '0px');
            viewShade.css('z-index', '99999');
            viewShade.on('click', function (e) {
                viewShade.remove();
            });
            let frame_left = 0;
            let frame_top = 10;
            let frame_w = pos.W;
            let frame_h = pos.H;
            if (me.Attribute.SchemeBootstrapLoading.OnCenter == false) {
                frame_top = scroll_y + 10;
                frame_left = scroll_x + container_w / 2 - pos.W / 2;

            } else {
                frame_left = scroll_x + container_w / 2 - pos.W / 2;
                frame_top = scroll_y + 10 + container_h / 2 - pos.H / 2;

            }
            loading_box.css('left', frame_left + 'px');
            loading_box.css('top', '-20px');
            loading_box.css('opacity', 0);

            loading_box.animate({
                top: frame_top + 'px',
                opacity: 1
            }, 200, function () {
                loading_box.css('top', (frame_top) + 'px');
                loading_box.css('opacity', 1);
            });
            setTimeout(function () {
                viewShade.remove();
            }, parseInt(me.Attribute.SchemeBootstrapLoading.ShowTime) * 1000);
        } else {
            let left = Math.max(0, (pos.W - 32) / 2);
            let top = Math.max(0, (pos.H - 32) / 2);
            loading_box.css('left', left + 'px');
            loading_box.css('top', top + 'px');
            box.append(loading_box);
        }
    };

    me.initChildClass = function (cfg) {
        me.setLayoutW(50);
        me.setLayoutH(50);
        me.Attribute.SchemeBootstrapLoading = {
            OnCenter: false,
            IconStyle: 'border',
            Style: 'dark',
            ShowTime: 2
        };
        initLoading();
    };
    me.loadChildClass = function (cfg) {
        initLoading();
    };
    me.viewChildClass = function (cfg) {
        isview = true;
        initLoading();
    };
    me.refreshChildView = function () {
        me.refreshStyle();
    };
};
