let WidgetColor = {};
/**
 * 返回颜色代码
 * @param {any} rgba
 */
WidgetColor.ColorObjectToCssCode = function (rgba) {
    return 'rgba(' + rgba.ColorR + ',' + rgba.ColorG + ',' + rgba.ColorB + ',' + rgba.A + ')';
};
/**图标 助手 */
let WidgetIcon = {
    childrenTags: ['path', 'polygon', 'rect', 'circle', 'ellipse', 'line', 'polyline', 'text']
};
/**
 * 刷新图标样式
 * @param {any} svg
 * @param {any} stroke_width 描边宽
 * @param {any} stroke_color 描边色
 * @param {any} fill_color 填充色
 * @param {any} shadow 阴影
 */
WidgetIcon.refreshIconStyle = function (svg, stroke_width, stroke_color, fill_color, shadow) {
    let svgbox = svg.parent();
    svg.parent().css('overflow', 'visible');
    let stroke, fill;
    if (stroke_color.constructor == Object) {
        stroke = WidgetColor.ColorObjectToCssCode(stroke_color);
    } else {
        stroke = stroke_color;
    }
    if (fill_color.constructor == Object) {
        fill = WidgetColor.ColorObjectToCssCode(fill_color);
    } else {
        fill = fill_color;
    }
    $.each(WidgetIcon.childrenTags, function (n, v) {
        svg.find(v).attr('stroke-width', stroke_width + 'px');
        svg.find(v).attr('stroke', stroke);
        svg.find(v).attr('fill', fill);
        if (shadow) {
            //阴影
            let shadow_color;
            if (shadow.color.constructor == Object) {
                shadow_color = WidgetColor.ColorObjectToCssCode(shadow.color);
            } else {
                shadow_color = shadow.color;
            }
            let shadow_str = ''
                + parseInt(shadow.x) + 'px '
                + parseInt(shadow.y) + 'px '
                + parseInt(shadow.blur) + 'px '
                + shadow_color;
            svgbox.css('filter', 'drop-shadow(' + shadow_str + ')');
        }
        else {
            svgbox.css('filter', 'unset');
        }
    });

};
let Project = function (config) {
    let me = this;
    let myconfig = config || {};
    let designer = myconfig.designer;
    me.Name = '..';
    me.Id = '';
    me.Pages = [];
    me.Images = [];
    me.PageMenu = [];
    me.IsNew = true;
    me.canvasWidth = 200;//1024;
    me.canvasHeight = 200;//700;
    let setId = function (id) {
        me.Id = id;
        me.Version = LastVersion + 1;
    };
    //添加页面
    me.addPage = function (p) {
        let exist = false;
        $.each(me.Pages, function (n, v) {
            if (v.id == p.id) {
                exist = true;
                return false;
            }
        });
        if (exist) { return; }
        let page = {
            id: p.id,
            name: p.name,
            Type: p.type || 'page',
            Elements: [],
            DynamicPanal: [],
            Version: 0,
            LastVersion: 0
        };
        me.Pages.push(page);
        let data = JSON.stringify(page);
    };
    //删除页面
    me.removePage = function (pageid) {
        let i;
        $.each(me.Pages, function (n, v) {
            if (v.id == pageid) {
                i = n;
                return false;
            }
        });
        if (i) {
            me.Pages.splice(i, 1);
        }
    };
    //加载页面
    me.loadPage = function (data) {
        let exist = false;
        $.each(me.Pages, function (n, v) {
            if (v.id == data.id) {
                exist = true;
                return false;
            }
        });
        if (exist) { return; }
        let page = data;
        if (!data) {
            page = {
                id: data.PageId,
                name: '页面',
                Elements: [],
                DynamicPanal: [],
                Version: 0
            };
        }
        page.LastVersion = page.Version;
        me.Pages.push(page);
    }
    //更新页面名称
    me.updatePageName = function (pageid, name) {
        let page = me.getPage(pageid);
        page.name = name;
    }
    ////修改元素属性
    me.updateElementAttribute = function (pageid, elid, attr) {

    }
    //获取页面对象
    me.getPage = function (pageid) {
        let page;
        $.each(me.Pages, function (n, v) {
            if (v.id == pageid) {
                page = v;
                return false;
            }
        });
        return page;
    };
    me.updatePageMenu = function (data) {
        me.PageMenu = data;
        me.Version = LastVersion + 1;
    };

    //根据页面id和元素id获取页面里的元素
    me.getEl = function (pageid, elid) {
        let el;
        $.each(me.Pages, function (n, v) {
            if (v.id == pageid) {
                $.each(v.Elements, function (n1, v1) {
                    if (v1.id == elid) {
                        el = v1;
                        return false;
                    }
                });
                return false;
            }
        });
        return el;
    };
    //根据页面对象和元素id获取页面里的元素
    me.getPageEl = function (page, elid) {
        let el;
        $.each(page.Elements, function (n, v) {
            if (v.id == elid) {
                el = v;
                return false;
            }
        });
        return el;
    }

    //添加图像(base64/svg/path)
    me.addImage = function (image) {
        let obj = me.getImage(image.id);
        if (obj) {
            return obj;
        }
        obj = image;
        me.Images.push(obj);
        let data = JSON.stringify(me.Images);
        localStorage.setItem('projectImagesBuffer', data);
        return obj;
    }
    //获取图像
    me.getImage = function (id) {
        let image;
        $.each(me.Images, function (n, v) {
            if (v.id == id) {
                image = v;
                return false;
            }
        });
        return image;
    };
    //获取已存在的图像
    me.getExistImage = function (image) {
        let obj;
        $.each(me.Images, function (n, v) {
            if (v.image == image) {
                obj = v;
                return false;
            }
        });
        return obj;
    }

    me.load = function (data) {
        if (data) {
            me.Id = data.Id;
            me.Name = data.Name;
            me.IsNew = false;
            me.Pages = data.Pages;
            me.Images = data.Images;
            me.PageMenu = data.PageMenu;
        }
    };
};
let viewApp = {
    /*页面元素加载完成后执行的函数*/
    pageElementsCompletedFuns: [],
    addPageElementsCompletedFuns: function (elid, fn) {
        let i = -1;
        $.each(this.pageElementsCompletedFuns, function (n, v) {
            if (v.id == elid) {
                i = n;
                return false;
            }
        });
        if (i >= 0) {
            this.pageElementsCompletedFuns = this.pageElementsCompletedFuns.splice(i, 1);
        }
        this.pageElementsCompletedFuns.push({ id: elid, run: fn });
        try { fn(); }
        catch (ex) { console.log(ex); }
    }
};
